INSERT INTO ability VALUES(1,'stench',NULL,'Has a 10% chance of making target Pokémon flinch with each hit.',replace('This Pokémon''s damaging moves have a 10% chance to make the target flinch with each hit if they do not already cause flinching as a secondary effect.\n\nThis ability does not stack with a held item.\n\nOverworld: The wild encounter rate is halved while this Pokémon is first in the party.','\n',char(10)));
INSERT INTO ability VALUES(2,'drizzle',NULL,'Summons rain that lasts indefinitely upon entering battle.',replace('The weather changes to rain when this Pokémon enters battle and does not end unless replaced by another weather condition.\n\nIf multiple Pokémon with this ability, drought, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','\n',char(10)));
INSERT INTO ability VALUES(3,'speed-boost',NULL,'Raises Speed one stage after each turn.','This Pokémon''s Speed rises one stage after each turn.');
INSERT INTO ability VALUES(4,'battle-armor',NULL,'Protects against critical hits.',replace('Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to shell armor.','\n',char(10)));
INSERT INTO ability VALUES(5,'sturdy',NULL,'Prevents being KOed from full HP, leaving 1 HP instead.  Protects against the one-hit KO moves regardless of HP.',replace('When this Pokémon is at full HP, any hit that would knock it out will instead leave it with 1 HP.  Regardless of its current HP, it is also immune to the one-hit KO moves: fissure, guillotine, horn drill, and sheer cold.\n\nIf this Pokémon is holding a focus sash, this ability takes precedence and the item will not be consumed.','\n',char(10)));
INSERT INTO ability VALUES(6,'damp',NULL,'Prevents self destruct, explosion, and aftermath from working while the Pokémon is in battle.','While this Pokémon is in battle, self destruct and explosion will fail and aftermath will not take effect.');
INSERT INTO ability VALUES(7,'limber',NULL,'Prevents paralysis.',replace('This Pokémon cannot be paralyzed.\n\nIf a Pokémon is paralyzed and acquires this ability, its paralysis is healed; this includes when regaining a lost ability upon leaving battle.','\n',char(10)));
INSERT INTO ability VALUES(8,'sand-veil',NULL,'Increases evasion to 1.25× during a sandstorm.  Protects against sandstorm damage.',replace('During a sandstorm, this Pokémon has 1.25× its evasion, and it does not take sandstorm damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.','\n',char(10)));
INSERT INTO ability VALUES(9,'static',NULL,'Has a 30% chance of paralyzing attacking Pokémon on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being paralyzed.\n\nPokémon that are immune to electric-type moves can still be paralyzed by this ability.\n\nOverworld: If the lead Pokémon has this ability, there is a 50% chance that encounters will be with an electric Pokémon, if applicable.','\n',char(10)));
INSERT INTO ability VALUES(10,'volt-absorb',NULL,'Absorbs electric moves, healing for 1/4 max HP.',replace('Whenever an electric-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is ground-type and thus immune to Electric moves.  Electric moves will ignore this Pokémon''s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.','\n',char(10)));
INSERT INTO ability VALUES(11,'water-absorb',NULL,'Absorbs water moves, healing for 1/4 max HP.',replace('Whenever a water-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nWater moves will ignore this Pokémon''s substitute.','\n',char(10)));
INSERT INTO ability VALUES(12,'oblivious',NULL,'Prevents infatuation and protects against captivate.',replace('This Pokémon cannot be infatuated and is immune to captivate.\n\nIf a Pokémon is infatuated and acquires this ability, its infatuation is cleared.','\n',char(10)));
INSERT INTO ability VALUES(13,'cloud-nine',NULL,'Negates all effects of weather, but does not prevent the weather itself.',replace('While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to air lock.','\n',char(10)));
INSERT INTO ability VALUES(14,'compound-eyes',NULL,'Increases moves'' accuracy to 1.3×.',replace('This Pokémon''s moves have 1.3× their accuracy.\n\nThis ability has no effect on the one-hit KO moves (fissure, guillotine, horn drill, and sheer cold).\n\nOverworld: If the first Pokémon in the party has this ability, the chance of a wild Pokémon holding a particular item is raised from 50%, 5%, or 1% to 60%, 20%, or 5%, respectively.','\n',char(10)));
INSERT INTO ability VALUES(15,'insomnia',NULL,'Prevents sleep.',replace('This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to vital spirit in battle.','\n',char(10)));
INSERT INTO ability VALUES(16,'color-change',NULL,'Changes type to match when hit by a damaging move.',replace('Whenever this Pokémon takes damage from a move, the Pokémon''s type changes to match the move.\n\nIf the Pokémon has two types, both are overridden.  The Pokémon must directly take damage; for example, moves blocked by a substitute will not trigger this ability, nor will moves that deal damage indirectly, such as spikes.\n\nThis ability takes effect on only the last hit of a multiple-hit attack.\n\nIn Pokémon Colosseum and XD: Gale of Darkness, this ability does not take effect on Shadow-type moves.','\n',char(10)));
INSERT INTO ability VALUES(17,'immunity',NULL,'Prevents poison.',replace('This Pokémon cannot be poisoned.  This includes bad poison.\n\nIf a Pokémon is poisoned and acquires this ability, its poison is healed; this includes when regaining a lost ability upon leaving battle.','\n',char(10)));
INSERT INTO ability VALUES(18,'flash-fire',NULL,'Protects against fire moves.  Once one has been blocked, the Pokémon''s own Fire moves inflict 1.5× damage until it leaves battle.',replace('This Pokémon is immune to fire-type moves.  Once this Pokémon has been hit by a Fire move, its own Fire moves will inflict 1.5× as much damage until it leaves battle.\n\nThis ability has no effect while the Pokémon is frozen.  The Fire damage bonus is retained even if the Pokémon is frozen and thawed or the ability is lost or disabled.  Fire moves will ignore this Pokémon''s substitute.  This ability takes effect even on non-damaging moves, i.e. will o wisp.','\n',char(10)));
INSERT INTO ability VALUES(19,'shield-dust',NULL,'Protects against incoming moves'' extra effects.',replace('This Pokémon is immune to the extra effects of moves used against it.\n\nAn extra effect is a move''s chance, listed as an `effect chance`, to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect.  For example, thunder shock''s paralysis is an extra effect, but thunder wave''s is not, nor are knock off''s item removal and air cutter''s increased critical hit rate.','\n',char(10)));
INSERT INTO ability VALUES(20,'own-tempo',NULL,'Prevents confusion.',replace('This Pokémon cannot be confused.\n\nIf a Pokémon is confused and acquires this ability, its confusion will immediately be healed.','\n',char(10)));
INSERT INTO ability VALUES(21,'suction-cups',NULL,'Prevents being forced out of battle by other Pokémon''s moves.',replace('This Pokémon cannot be forced out of battle by moves such as whirlwind.\n\ndragon tail and circle throw still inflict damage against this Pokémon.\n\nOverworld: If the lead Pokémon has this ability, the success rate while fishing is increased.','\n',char(10)));
INSERT INTO ability VALUES(22,'intimidate',NULL,'Lowers opponents'' Attack one stage upon entering battle.',replace('When this Pokémon enters battle, the opponent''s Attack is lowered by one stage.  In a double battle, both opponents are affected.\n\nThis ability also takes effect when acquired during a battle, but will not take effect again if lost and reobtained without leaving battle.\n\nThis ability has no effect on an opponent that has a substitute.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.','\n',char(10)));
INSERT INTO ability VALUES(23,'shadow-tag',NULL,'Prevents opponents from fleeing or switching out.',replace('While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.\n\nOther Pokémon with this ability are unaffected.  Pokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.','\n',char(10)));
INSERT INTO ability VALUES(24,'rough-skin',NULL,'Damages attacking Pokémon for 1/8 their max HP on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user takes 1/8 of its maximum HP in damage.\n\nThis ability functions identically to iron barbs.','\n',char(10)));
INSERT INTO ability VALUES(25,'wonder-guard',NULL,'Protects against damaging moves that are not super effective.',replace('This Pokémon is immune to damaging moves that are not super effective against it.\n\nMoves that inflict fixed damage, such as night shade or seismic toss, are considered super effective if their types are.  Damage not directly dealt by moves, such as damage from weather, a status ailment, or spikes, is not prevented.\n\nThis ability cannot be copied with role play or traded away with skill swap, but it can be copied with trace, disabled with gastro acid, or changed with worry seed.  This Pokémon can still use Role Play itself to lose this ability, but not Skill Swap.\n\nIf this Pokémon has a substitute, this ability will block moves as usual and any moves not blocked will react to the Substitute as usual.','\n',char(10)));
INSERT INTO ability VALUES(26,'levitate',NULL,'Evades ground moves.',replace('This Pokémon is immune to ground-type moves, spikes, toxic spikes, and arena trap.\n\nThis ability is disabled during gravity or ingrain, or while holding an iron ball.  This ability is not disabled during roost.','\n',char(10)));
INSERT INTO ability VALUES(27,'effect-spore',NULL,'Has a 30% chance of inflcting either paralysis, poison, or sleep on attacking Pokémon on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being paralyzed, poisoned, or put to sleep, chosen at random.\n\nNothing is done to compensate if the move''s user is immune to one of these ailments; there is simply a lower chance that the move''s user will be affected.','\n',char(10)));
INSERT INTO ability VALUES(28,'synchronize',NULL,'Copies burns, paralysis, and poison received onto the Pokémon that inflicted them.',replace('Whenever this Pokémon is burned, paralyzed, or poisoned, the Pokémon who gave this Pokémon that ailment is also given the ailment.\n\nThis ability passes back bad poison when this Pokémon is badly poisoned.  This ability cannot pass on a status ailment that the Pokémon did not directly receive from another Pokémon, such as the poison from toxic spikes or the burn from a flame orb.\n\nOverworld: If the lead Pokémon has this ability, wild Pokémon have a 50% chance of having the lead Pokémon''s nature, and a 50% chance of being given a random nature as usual, including the lead Pokémon''s nature.  This does not work on Pokémon received outside of battle or roaming legendaries.','\n',char(10)));
INSERT INTO ability VALUES(29,'clear-body',NULL,'Prevents stats from being lowered by other Pokémon.',replace('This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to white smoke in battle.','\n',char(10)));
INSERT INTO ability VALUES(30,'natural-cure',NULL,'Cures any major status ailment upon switching out.',replace('This Pokémon is cured of any major status ailment when it is switched out for another Pokémon.\n\nIf this ability is acquired during battle, the Pokémon is cured upon leaving battle before losing the temporary ability.','\n',char(10)));
INSERT INTO ability VALUES(31,'lightning-rod',NULL,'Redirects single-target electric moves to this Pokémon where possible.  Absorbs Electric moves, raising Special Attack one stage.',replace('All other Pokémon''s single-target electric-type moves are redirected to this Pokémon if it is an eligible target.  Other Pokémon''s Electric moves raise this Pokémon''s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move''s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.\n\nIf the Pokémon is a ground-type and thus immune to Electric moves, its immunity prevents the Special Attack boost.','\n',char(10)));
INSERT INTO ability VALUES(32,'serene-grace',NULL,'Doubles the chance of moves'' extra effects occurring.',replace('This Pokémon''s moves have twice their usual effect chance.\n\nAn effect chance is a move''s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect.  For example, flamethrower''s chance of burning the target is doubled, but protect''s chance of success and air cutter''s increased critical hit rate are unaffected.\n\nsecret power is unaffected.','\n',char(10)));
INSERT INTO ability VALUES(33,'swift-swim',NULL,'Doubles Speed during rain.',replace('This Pokémon''s Speed is doubled during rain.\n\nThis bonus does not count as a stat modifier.','\n',char(10)));
INSERT INTO ability VALUES(34,'chlorophyll',NULL,'Doubles Speed during strong sunlight.',replace('This Pokémon''s Speed is doubled during strong sunlight.\n\nThis bonus does not count as a stat modifier.','\n',char(10)));
INSERT INTO ability VALUES(35,'illuminate',NULL,'Doubles the wild encounter rate.',replace('Overworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.\n\nThis ability has no effect in battle.','\n',char(10)));
INSERT INTO ability VALUES(36,'trace',NULL,'Copies an opponent''s ability upon entering battle.',replace('When this Pokémon enters battle, it copies a random opponent''s ability.\n\nThis ability cannot copy flower gift, forecast, illusion, imposter, multitype, trace, wonder guard, or zen mode.','\n',char(10)));
INSERT INTO ability VALUES(37,'huge-power',NULL,'Doubles Attack in battle.',replace('This Pokémon''s Attack is doubled while in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to pure power.','\n',char(10)));
INSERT INTO ability VALUES(38,'poison-point',NULL,'Has a 30% chance of poisoning attacking Pokémon on contact.','Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being poisoned.');
INSERT INTO ability VALUES(39,'inner-focus',NULL,'Prevents flinching.','This Pokémon cannot flinch.');
INSERT INTO ability VALUES(40,'magma-armor',NULL,'Prevents freezing.',replace('This Pokémon cannot be frozen.\n\nIf a Pokémon is frozen and acquires this ability, it will immediately thaw out; this includes when regaining a lost ability upon leaving battle.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or flame body.','\n',char(10)));
INSERT INTO ability VALUES(41,'water-veil',NULL,'Prevents burns.',replace('This Pokémon cannot be burned.\n\nIf a Pokémon is burned and acquires this ability, its burn is healed; this includes when regaining a lost ability upon leaving battle.','\n',char(10)));
INSERT INTO ability VALUES(42,'magnet-pull',NULL,'Prevents steel opponents from fleeing or switching out.',replace('While this Pokémon is in battle, opposing steel-type Pokémon cannot flee or switch out.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, Steel-type Pokémon have a higher encounter rate.','\n',char(10)));
INSERT INTO ability VALUES(43,'soundproof',NULL,'Protects against sound-based moves.',replace('This Pokémon is immune to moves flagged as being sound-based.\n\nheal bell is unaffected.  uproar still prevents this Pokémon from sleeping.  This Pokémon can still receive a Perish Song counter through baton pass, and will retain a Perish Song counter if it acquires this ability after Perish Song is used.\n\nhowl, roar of time, sonic boom, and yawn are not flagged as sound-based.','\n',char(10)));
INSERT INTO ability VALUES(44,'rain-dish',NULL,'Heals for 1/16 max HP after each turn during rain.','This Pokémon heals for 1/16 of its maximum HP after each turn during rain.');
INSERT INTO ability VALUES(45,'sand-stream',NULL,'Summons a sandstorm that lasts indefinitely upon entering battle.',replace('The weather changes to a sandstorm when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, drought, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.','\n',char(10)));
INSERT INTO ability VALUES(46,'pressure',NULL,'Increases the PP cost of moves targetting the Pokémon by one.',replace('Moves targetting this Pokémon use one extra PP.\n\nThis ability stacks if multiple targets have it.  This ability still affects moves that fail or miss.  This ability does not affect ally moves that target either the entire field or just its side, nor this Pokémon''s self-targetted moves; it does, however, affect single-targetted ally moves aimed at this Pokémon, ally moves that target all other Pokémon, and opponents'' moves that target the entire field.  If this ability raises a move''s PP cost above its remaining PP, it will use all remaining PP.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','\n',char(10)));
INSERT INTO ability VALUES(47,'thick-fat',NULL,'Halves damage from fire and ice moves.','This Pokémon takes half as much damage from fire- and ice-type moves.');
INSERT INTO ability VALUES(48,'early-bird',NULL,'Makes sleep pass twice as quickly.',replace('This Pokémon''s remaining sleep turn count falls by 2 rather than 1.\n\nIf this Pokémon''s sleep counter is at 1, it will fall to 0 and then the Pokémon will wake up.','\n',char(10)));
INSERT INTO ability VALUES(49,'flame-body',NULL,'Has a 30% chance of burning attacking Pokémon on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being burned.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or magma armor.','\n',char(10)));
INSERT INTO ability VALUES(50,'run-away',NULL,'Ensures success fleeing from wild battles.','This Pokémon is always successful fleeing from wild battles, even if trapped by a move or ability.');
INSERT INTO ability VALUES(51,'keen-eye',NULL,'Prevents accuracy from being lowered.',replace('This Pokémon cannot have its accuracy lowered.\n\nThis ability does not prevent any accuracy losses other than stat modifiers, such as the accuracy cut from fog; nor does it prevent other Pokémon''s evasion from making this Pokémon''s moves less accurate.  This Pokémon can still be passed negative accuracy modifiers through heart swap.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.','\n',char(10)));
INSERT INTO ability VALUES(52,'hyper-cutter',NULL,'Prevents Attack from being lowered by other Pokémon.',replace('This Pokémon''s Attack cannot be lowered by other Pokémon.\n\nThis ability does not prevent any Attack losses other than stat modifiers, such as the Attack cut from a burn.  This Pokémon can still be passed negative Attack modifiers through heart swap or power swap.','\n',char(10)));
INSERT INTO ability VALUES(53,'pickup',NULL,'Picks up other Pokémon''s used and Flung held items.  May also pick up an item after battle.',replace('At the end of each turn, if another Pokémon consumed or Flung a held item that turn, this Pokémon picks up the item if it is not already holding one.  After each battle, this Pokémon has a 10% chance of picking up an item if it is not already holding one.\n\nThe air balloon and eject button cannot be picked up.\n\nThe items that may be found vary by game, and, since Pokémon Emerald, by the Pokémon''s level.  This ability is checked after the battle ends, at which point any temporary ability changes have worn off.','\n',char(10)));
INSERT INTO ability VALUES(54,'truant',NULL,'Skips every second turn.',replace('Every second turn on which this Pokémon should attempt to use a move, it will instead do nothing (`loaf around`).\n\nLoafing around interrupts moves that take multiple turns the same way paralysis, flinching, etc do.  Most such moves, for example bide or rollout, are simply cut off upon loafing around.  Attacks with a recharge turn, such as hyper beam, do not have to recharge; attacks with a preparation turn, such as fly, do not end up being used.  Moves that are forced over multiple turns and keep going through failure, such as outrage, uproar, or any move forced by encore, keep going as usual.\n\nIf this Pokémon is confused, its confusion is not checked when loafing around; the Pokémon cannot hurt itself, and its confusion does not end or come closer to ending.\n\nIf this Pokémon attempts to move but fails, e.g. because of paralysis or gravity, it still counts as having moved and will loaf around the next turn.  If it does not attempt to move, e.g. because it is asleep or frozen, whatever it would have done will be postponed until its next attempt; that is, it will either loaf around or move as usual, depending on what it last did.\n\nThis ability cannot be changed with worry seed, but it can be disabled with gastro acid, changed with role play, or traded away with skill swap.','\n',char(10)));
INSERT INTO ability VALUES(55,'hustle',NULL,'Strengthens physical moves to inflict 1.5× damage, but decreases their accuracy to 0.8×.',replace('This Pokémon''s physical moves do 1.5× as much regular damage, but have 0.8× their usual accuracy.\n\nSpecial moves are unaffected.  Moves that do set damage, such as seismic toss, have their accuracy affected, but not their damage.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','\n',char(10)));
INSERT INTO ability VALUES(56,'cute-charm',NULL,'Has a 30% chance of infatuating attacking Pokémon on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user has a 30% chance of being infatuated.\n\nOverworld: If the first Pokémon in the party has this ability, any wild Pokémon whose species can be either gender has a 2/3 chance of being set to the opposite gender, and a 1/3 chance of having a random gender as usual.','\n',char(10)));
INSERT INTO ability VALUES(57,'plus',NULL,'Increases Special Attack to 1.5× when a friendly Pokémon has plus or minus.',replace('This Pokémon has 1.5× its Special Attack if any friendly Pokémon has plus or minus.\n\nThis bonus does not count as a stat modifier.  If either ability is disabled by gastro acid, both lose their effect.','\n',char(10)));
INSERT INTO ability VALUES(58,'minus',NULL,'Increases Special Attack to 1.5× when a friendly Pokémon has plus or minus.',replace('This Pokémon has 1.5× its Special Attack if any friendly Pokémon has plus or minus.\n\nThis bonus does not count as a stat modifier.  If either ability is disabled by gastro acid, both lose their effect.','\n',char(10)));
INSERT INTO ability VALUES(59,'forecast',NULL,'Changes castform''s type and form to match the weather.',replace('During rain, strong sunlight, or hail, this Pokémon''s type changes to water, fire, or ice, respectively, and its form changes to match.\n\nThis ability has no effect for any Pokémon other than castform.\n\nIf the weather ends or becomes anything that does not trigger this ability, or a Pokémon with air lock or cloud nine enters battle, this Pokémon''s type and form revert to their default.  If this ability is lost or disabled, this Pokémon cannot change its current type and form until it regains its ability.','\n',char(10)));
INSERT INTO ability VALUES(60,'sticky-hold',NULL,'Prevents a held item from being removed by other Pokémon.',replace('This Pokémon''s hold item cannot be removed by other Pokémon.\n\nDamaging moves that would remove this Pokémon''s item can still inflict damage against this Pokémon, e.g. knock off or pluck.  This Pokémon can still use moves that involve the loss of its own item, e.g. fling or trick.\n\nOverworld: If the lead Pokémon has this ability, the encounter rate while fishing is increased.','\n',char(10)));
INSERT INTO ability VALUES(61,'shed-skin',NULL,'Has a 33% chance of curing any major status ailment after each turn.','After each turn, this Pokémon has a 33% of being cured of any major status ailment.');
INSERT INTO ability VALUES(62,'guts',NULL,'Increases Attack to 1.5× with a major status ailment.',replace('Whenever this Pokémon is asleep, burned, paralyzed, or poisoned, it has 1.5× its Attack.  This Pokémon is not affected by the usual Attack cut from a burn.\n\nThis bonus does not count as a stat modifier.','\n',char(10)));
INSERT INTO ability VALUES(63,'marvel-scale',NULL,'Increases Defense to 1.5× with a major status ailment.',replace('Whenever this Pokémon has a major status ailment, it has 1.5× its Defense.\n\nThis bonus does not count as a stat modifier.','\n',char(10)));
INSERT INTO ability VALUES(64,'liquid-ooze',NULL,'Damages opponents using leeching moves for as much as they would heal.',replace('Whenever a Pokémon would heal after hitting this Pokémon with a leeching move like absorb, it instead loses as many HP as it would usually gain.\n\ndream eater is unaffected.','\n',char(10)));
INSERT INTO ability VALUES(65,'overgrow',NULL,'Strengthens grass moves to inflict 1.5× damage at 1/3 max HP or less.','When this Pokémon has 1/3 or less of its HP remaining, its grass-type moves inflict 1.5× as much regular damage.');
INSERT INTO ability VALUES(66,'blaze',NULL,'Strengthens fire moves to inflict 1.5× damage at 1/3 max HP or less.','When this Pokémon has 1/3 or less of its HP remaining, its fire-type moves inflict 1.5× as much regular damage.');
INSERT INTO ability VALUES(67,'torrent',NULL,'Strengthens water moves to inflict 1.5× damage at 1/3 max HP or less.','When this Pokémon has 1/3 or less of its HP remaining, its water-type moves inflict 1.5× as much regular damage.');
INSERT INTO ability VALUES(68,'swarm',NULL,'Strengthens bug moves to inflict 1.5× damage at 1/3 max HP or less.',replace('When this Pokémon has 1/3 or less of its HP remaining, its bug-type moves inflict 1.5× as much regular damage.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is increased.','\n',char(10)));
INSERT INTO ability VALUES(69,'rock-head',NULL,'Protects against recoil damage.',replace('This Pokémon does not receive recoil damage from its recoil moves.\n\nstruggle''s recoil is unaffected.  This ability does not prevent crash damage from missing with jump kick or high jump kick.','\n',char(10)));
INSERT INTO ability VALUES(70,'drought',NULL,'Summons strong sunlight that lasts indefinitely upon entering battle.',replace('The weather changes to strong sunlight when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','\n',char(10)));
INSERT INTO ability VALUES(71,'arena-trap',NULL,'Prevents opponents from fleeing or switching out.  Eluded by flying-types and Pokémon in the air.',replace('While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.  flying-type Pokémon and Pokémon in the air, e.g. due to levitate or magnet rise, are unaffected.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.','\n',char(10)));
INSERT INTO ability VALUES(72,'vital-spirit',NULL,'Prevents sleep.',replace('This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to insomnia in battle.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','\n',char(10)));
INSERT INTO ability VALUES(73,'white-smoke',NULL,'Prevents stats from being lowered by other Pokémon.',replace('This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis; nor self-inflicted stat drops, such as the Special Attack drop from overheat; nor opponent-triggered stat boosts, such as the Attack boost from swagger.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to clear body in battle.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.','\n',char(10)));
INSERT INTO ability VALUES(74,'pure-power',NULL,'Doubles Attack in battle.',replace('This Pokémon''s Attack is doubled in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to huge power.','\n',char(10)));
INSERT INTO ability VALUES(75,'shell-armor',NULL,'Protects against critical hits.',replace('Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to battle armor.','\n',char(10)));
INSERT INTO ability VALUES(76,'air-lock',NULL,'Negates all effects of weather, but does not prevent the weather itself.',replace('While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to cloud nine.','\n',char(10)));
INSERT INTO ability VALUES(77,'tangled-feet',NULL,'Doubles evasion when confused.','When this Pokémon is confused, it has twice its evasion.');
INSERT INTO ability VALUES(78,'motor-drive',NULL,'Absorbs electric moves, raising Speed one stage.',replace('Whenever an electric-type move hits this Pokémon, its Speed rises one stage, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is immune to Electric moves.  Electric moves will ignore this Pokémon''s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.','\n',char(10)));
INSERT INTO ability VALUES(79,'rivalry',NULL,'Increases damage inflicted to 1.25× against Pokémon of the same gender, but decreases damage to 0.75× against the opposite gender.',replace('This Pokémon inflicts 1.25× as much regular damage against Pokémon of the same gender and 0.75× as much regular damage against Pokémon of the opposite gender.\n\nIf either Pokémon is genderless, damage is unaffected.','\n',char(10)));
INSERT INTO ability VALUES(80,'steadfast',NULL,'Raises Speed one stage upon flinching.','Whenever this Pokémon flinches, its Speed rises one stage.');
INSERT INTO ability VALUES(81,'snow-cloak',NULL,'Increases evasion to 1.25× during hail.  Protects against hail damage.',replace('During hail, this Pokémon has 1.25× its evasion, and it does not take hail damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in snow.','\n',char(10)));
INSERT INTO ability VALUES(82,'gluttony',NULL,'Makes the Pokémon eat any held Berry triggered by low HP below 1/2 its max HP.','This Pokémon eats any held Berry triggered by low HP when it falls below 50% of its HP, regardless of the Berry''s usual threshold.');
INSERT INTO ability VALUES(83,'anger-point',NULL,'Raises Attack to the maximum of six stages upon receiving a critical hit.',replace('Whenever this Pokémon receives a critical hit, its Attack rises to the maximum of 6 stages.\n\nThis ability will still take effect if the critical hit is received by a substitute.','\n',char(10)));
INSERT INTO ability VALUES(84,'unburden',NULL,'Doubles Speed upon using or losing a held item.',replace('When this Pokémon uses or loses its held item, its Speed is doubled.  If it gains another item or leaves battle, this bonus is lost.\n\nThis includes when the Pokémon drops its item because of knock off.  This bonus does not count as a stat modifier.  There is no notification when this ability takes effect.','\n',char(10)));
INSERT INTO ability VALUES(85,'heatproof',NULL,'Halves damage from fire moves and burns.','This Pokémon takes half as much damage from fire-type moves and burns.');
INSERT INTO ability VALUES(86,'simple',NULL,'Doubles the Pokémon''s stat modifiers.  These doubled modifiers are still capped at -6 or 6 stages.',replace('Each stage of this Pokémon''s stat modifiers acts as two stages.  These doubled stages are still limited to a minimum of -6 and a maximum of 6.\n\nThis Pokémon can still accumulate less than -3 or more than 3 stages of stat modifiers, even though the extra ones have no effect after doubling.','\n',char(10)));
INSERT INTO ability VALUES(87,'dry-skin',NULL,'Causes 1/8 max HP in damage each turn during strong sunlight, but heals for 1/8 max HP during rain.  Increases damage from fire moves to 1.25×, but absorbs water moves, healing for 1/4 max HP.','This Pokémon takes 1/8 of its maximum HP in damage after each turn during strong sunlight, but it heals for 1/8 of its HP each turn during rain.  This Pokémon takes 1.25× as much damage from fire-type moves, but whenever a water move hits it, it heals for 1/4 its maximum HP instead.');
INSERT INTO ability VALUES(88,'download',NULL,'Raises the attack stat corresponding to the opponents'' weaker defense one stage upon entering battle.',replace('When this Pokémon enters battle, its Attack or Special Attack, whichever corresponds to its opponents'' weaker total defensive stat, rises one stage.  In the event of a tie, Special Attack is raised.\n\nThis ability also takes effect when acquired during a battle.','\n',char(10)));
INSERT INTO ability VALUES(89,'iron-fist',NULL,'Strengthens punch-based moves to 1.2× their power.',replace('Moves flagged as being punch-based have 1.2× their base power for this Pokémon.\n\nsucker punch is not flagged as punch-based; its original, Japanese name only means `surprise attack`.','\n',char(10)));
INSERT INTO ability VALUES(90,'poison-heal',NULL,'Heals for 1/8 max HP after each turn when poisoned in place of damage.','If this Pokémon is poisoned, it will heal for 1/8 of its maximum HP after each turn rather than taking damage.  This includes bad poison.');
INSERT INTO ability VALUES(91,'adaptability',NULL,'Increases the same-type attack bonus from 1.5× to 2×.','This Pokémon inflicts twice as much damage with moves whose types match its own, rather than the usual same-type attack bonus of 1.5×.');
INSERT INTO ability VALUES(92,'skill-link',NULL,'Extends two-to-five-hit moves and triple kick to their full length every time.','This Pokémon always hits five times with two-to-five-hit moves, such as icicle spear.  It also bypasses the accuracy checks on triple kick''s second and third hits.');
INSERT INTO ability VALUES(93,'hydration',NULL,'Cures any major status ailment after each turn during rain.','This Pokémon is cured of any major status ailment after each turn during rain.');
INSERT INTO ability VALUES(94,'solar-power',NULL,'Increases Special Attack to 1.5× but costs 1/8 max HP after each turn during strong sunlight.','During strong sunlight, this Pokémon has 1.5× its Special Attack but takes 1/8 of its maximum HP in damage after each turn.');
INSERT INTO ability VALUES(95,'quick-feet',NULL,'Increases Speed to 1.5× with a major status ailment.',replace('Whenever this Pokémon has a major status ailment, it has 1.5× its Speed.  This Pokémon is not affected by the usual Speed cut from paralysis.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.','\n',char(10)));
INSERT INTO ability VALUES(96,'normalize',NULL,'Makes the Pokémon''s moves all act normal-type.',replace('This Pokémon''s moves all act as if they were normal-type.\n\nMoves that inflict typeless damage do so as usual.  Moves of variable type, such as hidden power, are affected.  They otherwise work as usual, however; weather ball, for example, is always forced to be Normal, but it still has doubled power and looks different during weather.\n\nAs thunder wave is prevented by immunities, unlike most non-damaging moves, it does not affect ghost-type Pokémon under the effect of this ability.','\n',char(10)));
INSERT INTO ability VALUES(97,'sniper',NULL,'Strengthens critical hits to inflict 3× damage rather than 2×.','This Pokémon inflicts triple damage with critical hits, rather than the usual double damage.');
INSERT INTO ability VALUES(98,'magic-guard',NULL,'Protects against damage not directly caused by a move.',replace('This Pokémon is immune to damage not directly caused by a move.\n\nFor example, this Pokémon takes no damage from from weather, recoil, status ailments, or spikes, but it still suffers from the Attack cut when burned, and a life orb will still power up this Pokémon''s moves without damaging it.  Anything that directly depends on such damage will also not happen; for example, leech seed will neither hurt this Pokémon nor heal the opponent, and Pokémon with a jaboca berry or rowap berry will not consume the berry when hit by this Pokémon.\n\nThe following are unaffected: struggle, pain split (whether used by or against this Pokémon), belly drum, substitute, curse, moves that knock the user out, and damage from confusion.\n\nThis Pokémon will neither lose nor regain HP if it drains HP from a Pokémon with liquid ooze.\n\nIf this Pokémon is badly poisoned, the poison counter is still increased each turn; if the Pokémon loses this ability, it will begin taking as much damage as it would be if it had been taking increasing damage each turn.','\n',char(10)));
INSERT INTO ability VALUES(99,'no-guard',NULL,'Ensures all moves used by and against the Pokémon hit.',replace('Moves used by or against this Pokémon never miss.\n\nOne-hit KO moves are unaffected.  Moves affected by this ability can hit Pokémon during the preparation turn of moves like dig or fly.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.','\n',char(10)));
INSERT INTO ability VALUES(100,'stall',NULL,'Makes the Pokémon move last within its move''s priority bracket.',replace('This Pokémon moves last within its priority bracket.\n\nMultiple Pokémon with this ability move in order of Speed amongst themselves.\n\nThe full incense and lagging tail take precedence over this ability; that is, Pokémon with these items move after Pokémon with this ability.  Pokémon with both this ability and one of these items are delayed as much as if they had only the item.\n\nThis ability works as usual during trick room: Pokémon with this ability will move in reverse order of Speed after Pokémon without it.','\n',char(10)));
INSERT INTO ability VALUES(101,'technician',NULL,'Strengthens moves of 60 base power or less to 1.5× their power.',replace('This Pokémon''s moves have 1.5× their power if their base power is 60 or less.\n\nThis includes moves of variable power, such as hidden power and magnitude, when their power is 60 or less.  helping hand''s power boost is taken into account for any move, as is defense curl''s power boost for rollout.','\n',char(10)));
INSERT INTO ability VALUES(102,'leaf-guard',NULL,'Protects against major status ailments during strong sunlight.',replace('This Pokémon cannot be given a major status ailment during strong sunlight.\n\nThis ability does not heal prior status ailments.  rest will fail altogether with this ability in effect.  yawn will immediately fail if used on this Pokémon during strong sunlight, and an already-used Yawn will fail if the weather turns to strong sunlight in the meantime.','\n',char(10)));
INSERT INTO ability VALUES(103,'klutz',NULL,'Prevents the Pokémon from using its held item in battle.',replace('In battle, this Pokémon cannot use its held item, nor will the item have any passive effect on the battle, positive or negative.  This Pokémon also cannot use fling.\n\nThe Speed cut from the iron ball and the effort items (the macho brace, power weight, power bracer, power belt, power lens, power band, and power anklet) is unaffected.  Items that do not directly affect the battle, such as the exp share, the amulet coin, or the soothe bell, work as usual.  All held items work as usual out of battle.\n\nOther moves that use the held item, such as natural gift and switcheroo, work as usual.','\n',char(10)));
INSERT INTO ability VALUES(104,'mold-breaker',NULL,'Bypasses targets'' abilities if they could hinder or prevent a move.',replace('This Pokémon''s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon''s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon''s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon''s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon''s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to teravolt and turboblaze.','\n',char(10)));
INSERT INTO ability VALUES(105,'super-luck',NULL,'Raises moves'' critical hit rates one stage.','This Pokémon''s moves have critical hit rates one stage higher than normal.');
INSERT INTO ability VALUES(106,'aftermath',NULL,'Damages the attacker for 1/4 its max HP when knocked out by a contact move.','When this Pokémon is knocked out by a move that makes contact, the move''s user takes 1/4 its maximum HP in damage.');
INSERT INTO ability VALUES(107,'anticipation',NULL,'Notifies all trainers upon entering battle if an opponent has a super-effective move, self destruct, explosion, or a one-hit KO move.',replace('When this Pokémon enters battle, if one of its opponents has a move that is super effective against it, self destruct, explosion, or a one-hit knockout move, all participating trainers are notified.\n\nThe move itself is not revealed; only that there is such a move.  Moves that inflict typeless damage, such as future sight, and moves of variable type, such as hidden power, count as their listed types.  counter, metal burst, mirror coat, and one-hit KO moves to which this Pokémon is immune do not trigger this ability.','\n',char(10)));
INSERT INTO ability VALUES(108,'forewarn',NULL,'Reveals the opponents'' strongest move upon entering battle.',replace('When this Pokémon enters battle, it reveals the move with the highest base power known by any opposing Pokémon to all participating trainers.\n\nIn the event of a tie, one is chosen at random.\n\nMoves without a listed base power are assigned one as follows:\n\nPower | Moves\n----: | -----\n  160 | One-hit KO moves: fissure, guillotine, horn drill, and sheer cold\n  120 | Counter moves: counter, metal burst, and mirror coat\n   80 | Variable power or set damage: crush grip, dragon rage, electro ball, endeavor, final gambit, flail, frustration, grass knot, gyro ball, heat crash, heavy slam, hidden power, low kick, natural gift, night shade, psywave, return, reversal, seismic toss, sonic boom, trump card, and wring out\n    0 | Any such move not listed\n','\n',char(10)));
INSERT INTO ability VALUES(109,'unaware',NULL,'Ignores other Pokémon''s stat modifiers for damage and accuracy calculation.',replace('This Pokémon ignores other Pokémon''s stat modifiers for the purposes of damage and accuracy calculation.\n\nEffectively, this affects modifiers of every stat except Speed.\n\nThe power of punishment and stored power is calculated as usual.  When this Pokémon hurts itself in confusion, its stat modifiers affect damage as usual.','\n',char(10)));
INSERT INTO ability VALUES(110,'tinted-lens',NULL,'Doubles damage inflicted with not-very-effective moves.','This Pokémon deals twice as much damage with moves that are not very effective against the target.');
INSERT INTO ability VALUES(111,'filter',NULL,'Decreases damage taken from super-effective moves by 1/4.',replace('This Pokémon takes 0.75× as much damage from moves that are super effective against it.\n\nThis ability functions identically to solid rock.','\n',char(10)));
INSERT INTO ability VALUES(112,'slow-start',NULL,'Halves Attack and Speed for five turns upon entering battle.',replace('This Pokémon''s Attack and Speed are halved for five turns upon entering battle.\n\nThis ability also takes effect when acquired during battle.  If this Pokémon loses its ability before the five turns are up, its Attack and Speed return to normal; if it then regains this ability without leaving battle, its Attack and Speed are halved again, but the counter keeps counting from where it was.','\n',char(10)));
INSERT INTO ability VALUES(113,'scrappy',NULL,'Lets the Pokémon''s normal and fighting moves hit ghost Pokémon.',replace('This Pokémon ignores ghost-type Pokémon''s immunity to normal- and fighting-type moves.\n\nGhost Pokémon''s other types affect damage as usual.','\n',char(10)));
INSERT INTO ability VALUES(114,'storm-drain',NULL,'Redirects single-target water moves to this Pokémon where possible.  Absorbs Water moves, raising Special Attack one stage.',replace('All other Pokémon''s single-target water-type moves are redirected to this Pokémon, if it is an eligible target.  Other Pokémon''s Water moves raise this Pokémon''s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move''s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.','\n',char(10)));
INSERT INTO ability VALUES(115,'ice-body',NULL,'Heals for 1/16 max HP after each turn during hail.  Protects against hail damage.','This Pokémon heals for 1/16 of its maximum HP after each turn during hail, and it does not take hail damage regardless of type.');
INSERT INTO ability VALUES(116,'solid-rock',NULL,'Decreases damage taken from super-effective moves by 1/4.',replace('This Pokémon takes 0.75× as much damage from moves that are super effective against it.\n\nThis ability functions identically to filter.','\n',char(10)));
INSERT INTO ability VALUES(117,'snow-warning',NULL,'Summons hail that lasts indefinitely upon entering battle.',replace('The weather changes to hail when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, drought, or sand stream are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability''s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','\n',char(10)));
INSERT INTO ability VALUES(118,'honey-gather',NULL,'The Pokémon may pick up honey after battle.',replace('This Pokémon has a chance of picking up honey after each battle.  This chance starts at 5% and rises another 5% after every tenth level: 5% from level 1–10, 10% from 11–20, and so on, up to 50% from 91–100.\n\nThis ability is checked after the battle ends, at which point any temporary ability changes have worn off.','\n',char(10)));
INSERT INTO ability VALUES(119,'frisk',NULL,'Reveals an opponent''s held item upon entering battle.',replace('When this Pokémon enters battle, it reveals an opposing Pokémon''s held item to all participating trainers.\n\nIn a double battle, if one opponent has an item, this Pokémon will Frisk that Pokémon; if both have an item, it will Frisk one at random.','\n',char(10)));
INSERT INTO ability VALUES(120,'reckless',NULL,'Strengthens recoil moves to 1.2× their power.',replace('This Pokémon''s recoil moves and crash moves have 1.2× their base power.\n\nstruggle is unaffected.\n\nThe `crash moves` are the moves that damage the user upon missing: jump kick and high jump kick.','\n',char(10)));
INSERT INTO ability VALUES(121,'multitype',NULL,'Changes arceus''s type and form to match its held Plate.',replace('If this Pokémon is holding an elemental Plate, its type and form change to match the Plate.\n\nThis Pokémon''s held item, whether or not it is a Plate, cannot be taken by covet or thief, nor removed by knock off, nor traded by switcheroo or trick.  Covet, Thief, and Knock Off still inflict damage against this Pokémon.  Unlike with sticky hold, this Pokémon cannot use fling, Switcheroo, or Trick to lose its item itself, nor gain an item through Switcheroo or Trick if it does not have one.\n\nThis ability has no effect for any Pokémon other than arceus.  This ability cannot be traded with skill swap, nor copied with role play or trace, nor disabled with gastro acid, nor changed with worry seed.  This Pokémon cannot use Skill Swap or Role Play to lose its ability itself.  mold breaker cannot ignore this ability.\n\nIf a Pokémon Transforms into an Arceus with this ability, it will Transform into Arceus''s default, normal-type form.  If the Transforming Pokémon is holding a Plate, this ability will then activate and change the Pokémon into the corresponding form.','\n',char(10)));
INSERT INTO ability VALUES(122,'flower-gift',NULL,'Increases friendly Pokémon''s Attack and Special Defense to 1.5× during strong sunlight.',replace('Friendly Pokémon have 1.5× their Attack and Special Defense during strong sunlight if any friendly Pokémon has this ability.\n\nUnlike forecast, multitype, and zen mode, this ability is not tied to its Pokémon''s form change; cherrim will switch between its forms even if it loses this ability.  As such, this ability also works if obtained by a Pokémon other than Cherrim.','\n',char(10)));
INSERT INTO ability VALUES(123,'bad-dreams',NULL,'Damages sleeping opponents for 1/8 their max HP after each turn.','Opposing Pokémon take 1/8 of their maximum HP in damage after each turn while they are asleep.');
INSERT INTO ability VALUES(124,'pickpocket',NULL,'Steals attacking Pokémon''s held items on contact.',replace('Whenever a move makes contact with this Pokémon, if it does not have a held item, it steals the attacker''s held item.\n\nThis Pokémon cannot steal upon being knocked out.  It can steal if the attacker has a substitute, but cannot steal when its own Substitute is hit.  If a move hits multiple times, only the last hit triggers this ability.  If this Pokémon is wild, it cannot steal from a trained Pokémon.','\n',char(10)));
INSERT INTO ability VALUES(125,'sheer-force',NULL,'Strengthens moves with extra effects to 1.3× their power, but prevents their extra effects.',replace('This Pokémon''s moves with extra effects have 1.3× their power, but lose their extra effects.\n\nAn effect chance is a move''s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move''s main effect. For example, thunder shock''s paralysis is an extra effect, but thunder wave''s is not, nor are knock off''s item removal and air cutter''s increased critical hit rate.\n\nMoves that lower the user''s stats are unaffected.','\n',char(10)));
INSERT INTO ability VALUES(126,'contrary',NULL,'Inverts stat changes.','Whenever this Pokémon''s stats would be raised, they are instead lowered by the same amount, and vice versa.');
INSERT INTO ability VALUES(127,'unnerve',NULL,'Prevents opposing Pokémon from eating held Berries.',replace('Opposing Pokémon cannot eat held Berries while this Pokémon is in battle.\n\nAffected Pokémon can still use bug bite or pluck to eat a target''s Berry.','\n',char(10)));
INSERT INTO ability VALUES(128,'defiant',NULL,'Raises Attack two stages upon having any stat lowered.',replace('When any of this Pokémon''s stats are lowered, its Attack rises by two stages.\n\nIf multiple stats are lowered at once, this ability takes effect with each stat lowered.','\n',char(10)));
INSERT INTO ability VALUES(129,'defeatist',NULL,'Halves Attack and Special Attack at 50% max HP or less.','This Pokémon''s Attack and Special Attack are halved when it has half its HP or less.');
INSERT INTO ability VALUES(130,'cursed-body',NULL,'Has a 30% chance of Disabling any move that hits the Pokémon.','Moves that hit this Pokémon have a 30% chance of being Disabled afterward.');
INSERT INTO ability VALUES(131,'healer',NULL,'Has a 30% chance of curing each adjacent ally of any major status ailment after each turn.','Friendly Pokémon next to this Pokémon in double and triple battles each have a 30% chance of being cured of any major status ailment after each turn.');
INSERT INTO ability VALUES(132,'friend-guard',NULL,'Decreases all direct damage taken by friendly Pokémon to 0.75×.',replace('All friendly Pokémon take 0.75× as much direct damage from moves while this Pokémon is in battle.\n\nThis effect stacks if multiple allied Pokémon have it.','\n',char(10)));
INSERT INTO ability VALUES(133,'weak-armor',NULL,'Raises Speed and lowers Defense by one stage each upon being hit by a physical move.',replace('Whenever a physical move hits this Pokémon, its Speed rises one stage and its Defense falls one stage.\n\nThis ability triggers on every hit of a multiple-hit move.','\n',char(10)));
INSERT INTO ability VALUES(134,'heavy-metal',NULL,'Doubles the Pokémon''s weight.','This Pokémon has double the usual weight for its species.');
INSERT INTO ability VALUES(135,'light-metal',NULL,'Halves the Pokémon''s weight.','This Pokémon has half the usual weight for its species.');
INSERT INTO ability VALUES(136,'multiscale',NULL,'Halves damage taken from full HP.','This Pokémon takes half as much damage when it is hit having full HP.');
INSERT INTO ability VALUES(137,'toxic-boost',NULL,'Increases Attack to 1.5× when poisoned.','This Pokémon has 1.5× its Attack when poisoned.');
INSERT INTO ability VALUES(138,'flare-boost',NULL,'Increases Special Attack to 1.5× when burned.','This Pokémon has 1.5× its Special Attack when burned.');
INSERT INTO ability VALUES(139,'harvest',NULL,'Has a 50% chance of restoring a used Berry after each turn if the Pokémon has held no items in the meantime.','After each turn, if the last item this Pokémon consumed was a Berry and it is not currently holding an item, it has a 50% chance of regaining that Berry, or a 100% chance during strong sunlight.');
INSERT INTO ability VALUES(140,'telepathy',NULL,'Protects against friendly Pokémon''s damaging moves.','This Pokémon does not take damage from friendly Pokémon''s moves, including single-target moves aimed at it.');
INSERT INTO ability VALUES(141,'moody',NULL,'Raises a random stat two stages and lowers another one stage after each turn.',replace('After each turn, one of this Pokémon''s stats at random rises two stages, and another falls one stage.\n\nIf a stat is already at 6 or -6 stages, it will not be chosen to be increased or decreased, respectively.','\n',char(10)));
INSERT INTO ability VALUES(142,'overcoat',NULL,'Protects against damage from weather.','This Pokémon does not take damage from weather.');
INSERT INTO ability VALUES(143,'poison-touch',NULL,'Has a 30% chance of poisoning target Pokémon upon contact.',replace('This Pokémon''s contact moves have a 30% chance of poisoning the target with each hit.\n\nThis counts as an extra effect for the purposes of shield dust.  This ability takes effect before mummy.','\n',char(10)));
INSERT INTO ability VALUES(144,'regenerator',NULL,'Heals for 1/3 max HP upon switching out.',replace('This Pokémon regains 1/3 of its maximum HP when it is switched out for another Pokémon under any circumstances other than having fainted.\n\nThis ability does not take effect when a battle ends.','\n',char(10)));
INSERT INTO ability VALUES(145,'big-pecks',NULL,'Protects against Defense drops.',replace('This Pokémon''s Defense cannot be lowered by other Pokémon.\n\nThis Pokémon can still be passed negative Defense modifiers through heart swap or guard swap.','\n',char(10)));
INSERT INTO ability VALUES(146,'sand-rush',NULL,'Doubles Speed during a sandstorm.  Protects against sandstorm damage.','This Pokémon''s Speed is doubled during a sandstorm, and it does not take sandstorm damage, regardless of type.');
INSERT INTO ability VALUES(147,'wonder-skin',NULL,'Lowers incoming non-damaging moves'' base accuracy to exactly 50%.','Non-damaging moves have exactly 50% base accuracy against this Pokémon.');
INSERT INTO ability VALUES(148,'analytic',NULL,'Strengthens moves to 1.3× their power when moving last.',replace('This Pokémon''s moves have 1.3× their power when it moves last in a turn.\n\nfuture sight and doom desire are unaffected.','\n',char(10)));
INSERT INTO ability VALUES(149,'illusion',NULL,'Takes the appearance of the last conscious party Pokémon upon being sent out until hit by a damaging move.',replace('This Pokémon, upon being sent out, appears to have the species, nickname, and Poké Ball of the last Pokémon in the party that is able to battle.  This illusion breaks upon being hit by a damaging move.\n\nOther damage, e.g. from weather or spikes, does not break the illusion, nor does damage done to a substitute.\n\nIf the party order becomes temporarily shuffled around as Pokémon are switched out in battle, this ability chooses the last Pokémon according to that shuffled order.','\n',char(10)));
INSERT INTO ability VALUES(150,'imposter',NULL,'Transforms upon entering battle.','This Pokémon transforms into a random opponent upon entering battle.  This effect is identical to the move transform.');
INSERT INTO ability VALUES(151,'infiltrator',NULL,'Bypasses light screen, reflect, and safeguard.','This Pokémon''s moves ignore light screen, reflect, and safeguard.');
INSERT INTO ability VALUES(152,'mummy',NULL,'Changes attacking Pokémon''s abilities to Mummy on contact.',replace('Whenever a contact move hits this Pokémon, the attacking Pokémon''s ability changes to Mummy.\n\nmultitype is unaffected.  If a Pokémon with moxie knocks this Pokémon out, the former''s ability will change without taking effect.','\n',char(10)));
INSERT INTO ability VALUES(153,'moxie',NULL,'Raises Attack one stage upon KOing a Pokémon.',replace('This Pokémon''s Attack rises one stage upon knocking out another Pokémon, even a friendly Pokémon.\n\nThis ability does not take effect when the Pokémon indirectly causes another Pokémon to faint, e.g. through poison or spikes.\n\nIf this Pokémon knocks out a Pokémon with mummy, the former''s ability will change without taking effect.','\n',char(10)));
INSERT INTO ability VALUES(154,'justified',NULL,'Raises Attack one stage upon taking damage from a dark move.',replace('Whenever a dark-type move hits this Pokémon, its Attack rises one stage.\n\nThe move is not negated in any way.','\n',char(10)));
INSERT INTO ability VALUES(155,'rattled',NULL,'Raises Speed one stage upon being hit by a dark, ghost, or bug move.','This Pokémon''s Speed rises one stage with each hit from a damaging dark-, ghost-, or bug-type move.');
INSERT INTO ability VALUES(156,'magic-bounce',NULL,'Reflects most non-damaging moves back at their user.',replace('When this Pokémon is targeted by a move flagged as being reflectable, the move is redirected to its user.\n\nAll reflectable moves are non-damaging, and most non-damaging moves that target other Pokémon are reflectable.\n\nA move reflected by this ability or magic coat cannot be reflected back.','\n',char(10)));
INSERT INTO ability VALUES(157,'sap-sipper',NULL,'Absorbs grass moves, raising Attack one stage.','Whenever a grass-type move hits this Pokémon, its Attack rises one stage, negating any other effect on it.');
INSERT INTO ability VALUES(158,'prankster',NULL,'Raises non-damaging moves'' priority by one stage.','This Pokémon''s non-damaging moves have their priority increased by one stage.');
INSERT INTO ability VALUES(159,'sand-force',NULL,'Strengthens rock, ground, and steel moves to 1.3× their power during a sandstorm.  Protects against sandstorm damage.','During a sandstorm, this Pokémon''s rock-, ground-, and steel-type moves have 1.3× their base power.  This Pokémon does not take sandstorm damage, regardless of type.');
INSERT INTO ability VALUES(160,'iron-barbs',NULL,'Damages attacking Pokémon for 1/8 their max HP on contact.',replace('Whenever a move makes contact with this Pokémon, the move''s user takes 1/8 of its maximum HP in damage.\n\nThis ability functions identically to rough skin.','\n',char(10)));
INSERT INTO ability VALUES(161,'zen-mode',NULL,'Changes darmanitan''s form after each turn depending on its HP: Zen Mode below 50% max HP, and Standard Mode otherwise.',replace('This Pokémon switches between Standard Mode and Zen Mode after each turn depending on its HP.  Below 50% of its maximum HP, it switches to Zen Mode, and at 50% or above, it switches to Standard Mode.\n\nThis Pokémon returns to Standard Mode upon leaving battle or losing this ability.  This ability has no effect if this Pokémon is not a darmanitan.','\n',char(10)));
INSERT INTO ability VALUES(162,'victory-star',NULL,'Increases moves'' accuracy to 1.1× for friendly Pokémon.','All friendly Pokémon''s moves, including this Pokémon''s own moves, have 1.1× their usual accuracy while this Pokémon is in battle.');
INSERT INTO ability VALUES(163,'turboblaze',NULL,'Bypasses targets'' abilities if they could hinder or prevent moves.',replace('This Pokémon''s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon''s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon''s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon''s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon''s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and teravolt.','\n',char(10)));
INSERT INTO ability VALUES(164,'teravolt',NULL,'Bypasses targets'' abilities if they could hinder or prevent moves.',replace('This Pokémon''s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon''s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon''s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move''s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon''s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon''s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and turboblaze.','\n',char(10)));
INSERT INTO ability VALUES(165,'aroma-veil',NULL,'Protects allies against moves that affect their mental state.','Protects allies against moves that affect their mental state.');
INSERT INTO ability VALUES(166,'flower-veil',NULL,'Protects friendly grass Pokémon from having their stats lowered by other Pokémon.','Protects friendly grass Pokémon from having their stats lowered by other Pokémon.');
INSERT INTO ability VALUES(167,'cheek-pouch',NULL,'Restores HP upon eating a Berry, in addition to the Berry''s effect.','Restores HP upon eating a Berry, in addition to the Berry''s effect.');
INSERT INTO ability VALUES(168,'protean',NULL,'Changes the bearer''s type to match each move it uses.',replace('Changes the bearer''s type to match each move it uses.\n\nThe type change takes place just before the move is used.','\n',char(10)));
INSERT INTO ability VALUES(169,'fur-coat',NULL,'Halves damage from physical attacks.','Halves damage from physical attacks.');
INSERT INTO ability VALUES(170,'magician',NULL,'Steals the target''s held item when the bearer uses a damaging move.','Steals the target''s held item when the bearer uses a damaging move.');
INSERT INTO ability VALUES(171,'bulletproof',NULL,'Protects against bullet, ball, and bomb-based moves.','Protects against bullet, ball, and bomb-based moves.');
INSERT INTO ability VALUES(172,'competitive',NULL,'Raises Special Attack by two stages upon having any stat lowered.','Raises Special Attack by two stages upon having any stat lowered.');
INSERT INTO ability VALUES(173,'strong-jaw',NULL,'Strengthens biting moves to 1.5× their power.','Strengthens biting moves to 1.5× their power.');
INSERT INTO ability VALUES(174,'refrigerate',NULL,'Turns the bearer''s normal moves into ice moves and strengthens them to 1.3× their power.','Turns the bearer''s normal-type moves into ice-type moves.  Moves changed by this ability have 1.3× their power.');
INSERT INTO ability VALUES(175,'sweet-veil',NULL,'Prevents friendly Pokémon from sleeping.','Prevents friendly Pokémon from sleeping.');
INSERT INTO ability VALUES(176,'stance-change',NULL,'Changes aegislash to Blade Forme before using a damaging move, or Shield Forme before using kings shield.','Changes aegislash to Blade Forme before using a damaging move, or Shield Forme before using kings shield.');
INSERT INTO ability VALUES(177,'gale-wings',NULL,'Raises flying moves'' priority by one stage.','Raises flying moves'' priority by one stage.');
INSERT INTO ability VALUES(178,'mega-launcher',NULL,'Strengthens aura and pulse moves to 1.5× their power.','Strengthens aura and pulse moves to 1.5× their power.');
INSERT INTO ability VALUES(179,'grass-pelt',NULL,'Boosts Defense while grassy terrain is in effect.','Boosts Defense while grassy terrain is in effect.');
INSERT INTO ability VALUES(180,'symbiosis',NULL,'Passes the bearer''s held item to an ally when the ally uses up its item.','Passes the bearer''s held item to an ally when the ally uses up its item.');
INSERT INTO ability VALUES(181,'tough-claws',NULL,'Strengthens moves that make contact to 1.33× their power.','Strengthens moves that make contact to 1.33× their power.');
INSERT INTO ability VALUES(182,'pixilate',NULL,'Turns the bearer''s normal moves into fairy moves and strengthens them to 1.3× their power.','Turns the bearer''s normal-type moves into fairy moves.  Moves changed by this ability have 1.3× their power.');
INSERT INTO ability VALUES(183,'gooey',NULL,'Lowers attacking Pokémon''s Speed by one stage on contact.','Lowers attacking Pokémon''s Speed by one stage on contact.');
INSERT INTO ability VALUES(184,'aerilate',NULL,'Turns the bearer''s normal moves into flying moves and strengthens them to 1.3× their power.','Turns the bearer''s normal-type moves into flying-type moves.  Moves changed by this ability have 1.3× their power.');
INSERT INTO ability VALUES(185,'parental-bond',NULL,'Lets the bearer hit twice with damaging moves.  The second hit has half power.','Lets the bearer hit twice with damaging moves.  The second hit has half power.');
INSERT INTO ability VALUES(186,'dark-aura',NULL,'Strengthens dark moves to 1.33× their power for all friendly and opposing Pokémon.','Strengthens dark moves for all friendly and opposing Pokémon.');
INSERT INTO ability VALUES(187,'fairy-aura',NULL,'Strengthens fairy moves to 1.33× their power for all friendly and opposing Pokémon.','Strengthens fairy moves for all friendly and opposing Pokémon.');
INSERT INTO ability VALUES(188,'aura-break',NULL,'Makes dark aura and fairy aura weaken moves of their respective types.','While this Pokémon is on the field, dark aura and fairy aura weaken moves of their respective types to 2/3 their power, rather than strengthening them.');
INSERT INTO ability VALUES(189,'primordial-sea',NULL,'Creates heavy rain, which has all the properties of Rain Dance, cannot be replaced, and causes damaging Fire moves to fail.',replace('When this Pokémon enters battle or gains this ability, the weather becomes heavy rain.  Heavy rain has all the properties of rain dance and also causes damaging Fire moves to fail.\n\nHeavy rain ends when this Pokémon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of delta stream and desolate land.\n\nair lock and cloud nine will prevent the effects of heavy rain, including allowing Fire moves to work, but will not allow the weather to be changed.','\n',char(10)));
INSERT INTO ability VALUES(190,'desolate-land',NULL,'Creates extremely harsh sunlight, which has all the properties of Sunny Day, cannot be replaced, and causes damaging Water moves to fail.',replace('When this Pokémon enters battle or gains this ability, the weather becomes extremely harsh sunlight.  Extremely harsh sunlight has all the properties of sunny day and also causes damaging Water moves to fail.\n\nExtremely harsh sunlight ends when this Pokémon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of delta stream and primordial sea.\n\nair lock and cloud nine will prevent the effects of extremely harsh sunlight, including allowing Water moves to work, but will not allow the weather to be changed.','\n',char(10)));
INSERT INTO ability VALUES(191,'delta-stream',NULL,'Creates a mysterious air current, which cannot be replaced and causes moves to never be super effective against Flying Pokémon.',replace('When this Pokémon enters battle or gains this ability, the weather becomes a mysterious air current.  A mysterious air current causes moves to not be super effective against Flying; they do neutral damage instead.  anticipation and stealth rock are not affected.\n\nThe mysterious air current ends when this Pokémon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of desolate land and primordial sea.\n\nair lock and cloud nine will prevent the effect of a mysterious air current, but will not allow the weather to be changed.','\n',char(10)));
INSERT INTO ability VALUES(192,'stamina',NULL,'Raises this Pokémon''s Defense by one stage when it takes damage from a move.','Raises this Pokémon''s Defense by one stage when it takes damage from a move.');
INSERT INTO ability VALUES(193,'wimp-out',NULL,'This Pokémon automatically switches out when its HP drops below half.','After this Pokémon is hit by a move, if that move caused this Pokémon''s HP to drop below half, it switches out.');
INSERT INTO ability VALUES(194,'emergency-exit',NULL,'This Pokémon automatically switches out when its HP drops below half.','After this Pokémon is hit by a move, if that move caused this Pokémon''s HP to drop below half, it switches out.');
INSERT INTO ability VALUES(195,'water-compaction',NULL,'Raises this Pokémon''s Defense by two stages when it''s hit by a Water move.','Raises this Pokémon''s Defense by two stages when it''s hit by a Water move.');
INSERT INTO ability VALUES(196,'merciless',NULL,'This Pokémon''s moves critical hit against poisoned targets.','This Pokémon''s moves critical hit against poisoned targets.');
INSERT INTO ability VALUES(197,'shields-down',NULL,'Transforms this Minior between Core Form and Meteor Form.  Prevents major status ailments and drowsiness while in Meteor Form.',replace('When this Pokémon enters battle and at the end of each turn, if its HP is 50% or above, it changes into Meteor Form; otherwise, it changes into Core Form.  In Meteor Form, it cannot be given a major status ailment (though existing ones are not cured), cannot become drowsy from yawn, and cannot use rest (which will simply fail).\n\nThis ability cannot be copied, replaced, or nullified.  This ability only takes effect for Minior.','\n',char(10)));
INSERT INTO ability VALUES(198,'stakeout',NULL,'This Pokémon''s moves have double power against Pokémon that switched in this turn.','This Pokémon''s moves have double power against Pokémon that switched in this turn.');
INSERT INTO ability VALUES(199,'water-bubble',NULL,'Halves damage from Fire moves, doubles damage of Water moves, and prevents burns.','When this Pokémon is hit by a Fire move, the damage is halved.  When this Pokémon uses a Water move, the power is doubled. This Pokémon cannot be burned, and if it becomes burned, the burn is immediately cured.');
INSERT INTO ability VALUES(200,'steelworker',NULL,'This Pokémon''s Steel moves have 1.5× power.','This Pokémon''s Steel moves have 1.5× power.');
INSERT INTO ability VALUES(201,'berserk',NULL,'Raises this Pokémon''s Special Attack by one stage every time its HP drops below half.','Whenever this Pokémon takes damage from a move that causes its HP to drop below 50%, its Special Attack rises by one stage.');
INSERT INTO ability VALUES(202,'slush-rush',NULL,'During Hail, this Pokémon has double Speed.','During Hail, this Pokémon has double Speed.');
INSERT INTO ability VALUES(203,'long-reach',NULL,'This Pokémon''s moves do not make contact.','A move used by this Pokémon will not make contact.');
INSERT INTO ability VALUES(204,'liquid-voice',NULL,'Sound-based moves become Water-type.','When this Pokémon uses a move that is sound-based, that move''s type is Water.');
INSERT INTO ability VALUES(205,'triage',NULL,'This Pokémon''s healing moves have their priority increased by 3.','This Pokémon''s healing moves have their priority increased by 3.');
INSERT INTO ability VALUES(206,'galvanize',NULL,'This Pokémon''s Normal moves are Electric and have their power increased to 1.2×.','When this Pokémon uses a Normal moves, that move is Electric its power is 1.2×.');
INSERT INTO ability VALUES(207,'surge-surfer',NULL,'Doubles this Pokémon''s Speed on Electric Terrain.','Doubles this Pokémon''s Speed on Electric Terrain.');
INSERT INTO ability VALUES(208,'schooling',NULL,'Wishiwashi becomes Schooling Form when its HP is 25% or higher.',replace('If this Pokémon is a wishiwashi and level 20 or above, then when it enters battle and at the start of each turn, it becomes Schooling Form if its HP is 25% or higher and Solo Form otherwise.\n\nThis ability cannot be replaced, copied, or nullified.','\n',char(10)));
INSERT INTO ability VALUES(209,'disguise',NULL,'Prevents the first instance of battle damage.',replace('If this Pokémon is in its Disguised Form and takes damage from a move, it switches to its Busted Form and the damage is prevented.  Other effects are not prevented.\n\nThis ability cannot be copied or replaced.  This ability only takes effect for Mimikyu.','\n',char(10)));
INSERT INTO ability VALUES(210,'battle-bond',NULL,'Transforms this Pokémon into Ash-Greninja after fainting an opponent.  Water Shuriken''s power is 20 and always hits three times.',replace('Transforms this Pokémon into Ash-Greninja after fainting an opponent.  Water Shuriken''s power is 20 and always hits three times.\n\nThis ability cannot be copied or replaced.  This ability only takes effect for Greninja.','\n',char(10)));
INSERT INTO ability VALUES(211,'power-construct',NULL,'Transforms 10% or 50% Zygarde into Complete Forme when its HP is below 50%.',replace('Transforms 10% or 50% Zygarde into Complete Forme when its HP is below 50%.\n\nThis ability cannot be copied or replaced.  This ability only takes effect for Zygarde.','\n',char(10)));
INSERT INTO ability VALUES(212,'corrosion',NULL,'This Pokémon can inflict poison on Poison and Steel Pokémon.','This Pokémon''s moves and item ignore the usual immunity of Poison and Steel Pokémon when attempting to inflict poison.');
INSERT INTO ability VALUES(213,'comatose',NULL,'This Pokémon always  acts as though it were Asleep.','This Pokémon always acts as though it were Asleep.  It cannot be given another status ailment; it''s unaffected by yawn; it can use sleep talk; and so on.');
