INSERT INTO ability VALUES(215,'innards-out',NULL,'When this Pokémon faints from an opponent''s move, that opponent takes damage equal to the HP this Pokémon had remaining.','When this Pokémon faints from an opponent''s move, that opponent takes damage equal to the HP this Pokémon had remaining.');
