INSERT INTO move VALUES(90,'fissure','physical',5,NULL,0,30,'ground',NULL,'Causes a one-hit KO.',replace('Inflicts damage equal to the target''s max HP.  Ignores accuracy and evasion modifiers.  This move''s accuracy is 30% plus 1% for each level the user is higher than the target.  If the user is a lower level than the target, this move will fail.\n\nBecause this move inflicts a specific and finite amount of damage, endure still prevents the target from fainting.\n\nThe effects of lock on, mind reader, and no guard still apply, as long as the user is equal or higher level than the target.  However, they will not give this move a chance to break through detect or protect.','\n',char(10)),NULL);
INSERT INTO move VALUES(91,'dig','physical',10,80,0,100,'ground',NULL,'User digs underground, dodging all attacks, and hits next turn.',replace('Inflicts regular damage.  User digs underground for one turn, becoming immune to attack, and hits on the second turn.\n\nDuring the immune turn, earthquake, fissure, and magnitude still hit the user normally, and their power is doubled if appropriate.\n\nThe user may be hit during its immune turn if under the effect of lock on, mind reader, or no guard.\n\nThis move cannot be selected by sleep talk.','\n',char(10)),NULL);
