INSERT INTO move VALUES(113,'light-screen','status',30,NULL,0,NULL,'psychic',NULL,'Reduces damage from special attacks by 50% for five turns.',replace('Erects a barrier around the user''s side of the field that reduces damage from special attacks by half for five turns.  In double battles, the reduction is 1/3.  Critical hits are not affected by the barrier.\n\nIf the user is holding light clay, the barrier lasts for eight turns.\n\nbrick break or defog used by an opponent will destroy the barrier.','\n',char(10)),NULL);
