INSERT INTO move VALUES(161,'tri-attack','special',10,80,0,100,'normal',NULL,'Has a $effect_chance% chance to burn, freeze, or paralyze the target.','Inflicts regular damage.  Has a $effect_chance% chance to burn, freeze, or paralyze the target.  One of these effects is selected at random; they do not each have independent chances to occur.',20);
