INSERT INTO move VALUES(164,'substitute','status',10,NULL,0,NULL,'normal',NULL,'Transfers 1/4 of the user''s max HP into a doll, protecting the user from further damage or status changes until it breaks.',replace('Transfers 1/4 the user''s max HP into a doll that absorbs damage and causes most negative move effects to fail.  If the user leaves the field, the doll will vanish.  If the user cannot pay the HP cost, this move will fail.\n\nThe doll takes damage as normal, using the user''s stats and types, and will break when its HP reaches zero.  Self-inflicted damage from confusion or recoil is not absorbed.  Healing effects from opponents ignore the doll and heal the user as normal.  Moves that work based on the user''s HP still do so; the doll''s HP does not influence any move.\n\nThe doll will block major status effects, confusion, and flinching.  The effects of smelling salts and wake up slap do not trigger against a doll, even if the Pokémon behind the doll has the appropriate major status effect.  Multi-turn trapping moves like wrap will hit the doll for their regular damage, but the multi-turn trapping and damage effects will not activate.\n\nMoves blocked or damage absorbed by the doll do not count as hitting the user or inflicting damage for any effects that respond to such, e.g., avalanche, counter, or a rowap berry.  magic coat still works as normal, even against moves the doll would block.  Opposing Pokémon that damage the doll with a leech move like absorb are healed as normal.\n\nIt will also block acupressure, block, the curse effect of curse, dream eater, embargo, flatter, gastro acid, grudge, heal block, leech seed, lock on, mean look, mimic, mind reader, nightmare, pain split, psycho shift, spider web, sketch, swagger, switcheroo, trick, worry seed, and yawn.  A Pokémon affected by yawn before summoning the doll will still fall to sleep.\n\nThe doll blocks intimidate, but all other abilities act as though the doll did not exist.  If the user has an ability that absorbs moves of a certain type for HP (such as volt absorb absorbing thunder wave), such moves will not be blocked.\n\nlife orb and berries that cause confusion still work as normal, but their respective HP loss and confusion are absorbed/blocked by the doll.\n\nThe user is still vulnerable to damage inflicted when entering or leaving the field, such as by pursuit or spikes; however, the doll will block the poison effect of toxic spikes.\n\nThe doll is passed on by baton pass.  It keeps its existing HP, but uses the replacement Pokémon''s stats and types for damage calculation.\n\nAll other effects work as normal.','\n',char(10)),NULL);
INSERT INTO move VALUES(165,'struggle','physical',1,50,0,NULL,'normal',NULL,'User takes 1/4 its max HP in recoil.',replace('Inflicts typeless regular damage.  User takes 1/4 its max HP in recoil.  Ignores accuracy and evasion modifiers.\n\nThis move is used automatically when a Pokémon cannot use any other move legally, e.g., due to having no PP remaining or being under the effect of both encore and torment at the same time.\n\nThis move''s recoil is not treated as recoil for the purposes of anything that affects recoil, such as the ability rock head.  It also is not prevented by magic guard.\n\nThis move cannot be copied by mimic, mirror move, or sketch, nor selected by assist or metronome, nor forced by encore.','\n',char(10)),NULL);
INSERT INTO move VALUES(166,'sketch','status',1,NULL,0,NULL,'normal',NULL,'Permanently becomes the target''s last used move.',replace('Permanently replaces itself with the target''s last used move.  If that move is chatter or struggle, this move will fail.\n\nThis move cannot be copied by mimic or mirror move, nor selected by assist or metronome, nor forced by encore.','\n',char(10)),NULL);
INSERT INTO move VALUES(167,'triple-kick','physical',10,10,0,90,'fighting',NULL,'Hits three times, increasing power by 100% with each successful hit.',replace('Inflicts regular damage.  Hits three times in the same turn.  The second hit has double power, and the third hit has triple power.  Each hit has a separate accuracy check, and this move stops if a hit misses.\n\nskill link does not apply.','\n',char(10)),NULL);
INSERT INTO move VALUES(168,'thief','physical',25,60,0,100,'dark',NULL,'Takes the target''s item.',replace('Inflicts regular damage.  If the target is holding an item and the user is not, the user will permanently take the item.  Damage is still inflicted if an item cannot be taken.\n\nPokémon with sticky hold or multitype are immune to the item theft effect.\n\nThe target cannot recover its item with recycle.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(169,'spider-web','status',10,NULL,0,NULL,'bug',NULL,'Prevents the target from leaving battle.',replace('The target cannot switch out normally.  Ignores accuracy and evasion modifiers.  This effect ends when the user leaves the field.\n\nThe target may still escape by using baton pass, u turn, or a shed shell.\n\nBoth the user and the target pass on this effect with baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(170,'mind-reader','status',5,NULL,0,NULL,'normal',NULL,'Ensures that the user''s next move will hit the target.',replace('If the user targets the same target again before the end of the next turn, the move it uses is guaranteed to hit.  This move itself also ignores accuracy and evasion modifiers.\n\nOne-hit KO moves are also guaranteed to hit, as long as the user is equal or higher level than the target.  This effect also allows the user to hit Pokémon that are off the field due to moves such as dig or fly.\n\nIf the target uses detect or protect while under the effect of this move, the user is not guaranteed to hit, but has a (100 - accuracy)% chance to break through the protection.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(171,'nightmare','status',15,NULL,0,100,'ghost',NULL,'Target loses 1/4 its max HP every turn as long as it''s asleep.','Only works on sleeping Pokémon.  Gives the target a nightmare, damaging it for 1/4 its max HP every turn.  If the target wakes up or leaves the field, this effect ends.',NULL);
INSERT INTO move VALUES(172,'flame-wheel','physical',25,60,0,100,'fire',NULL,'Has a $effect_chance% chance to burn the target.  Lets frozen Pokémon thaw themselves.','Inflicts regular damage.  Has a $effect_chance% chance to burn the target.  Frozen Pokémon may use this move, in which case they will thaw.',10);
INSERT INTO move VALUES(173,'snore','special',15,50,0,100,'normal',NULL,'Has a $effect_chance% chance to make the target flinch.  Only works if the user is sleeping.','Only usable if the user is sleeping.  Inflicts regular damage.  Has a $effect_chance% chance to make the target flinch.',30);
INSERT INTO move VALUES(174,'curse','status',10,NULL,0,NULL,'ghost',NULL,'Ghosts pay half their max HP to hurt the target every turn.  Others decrease Speed but raise Attack and Defense.',replace('If the user is a ghost: user pays half its max HP to place a curse on the target, damaging it for 1/4 its max HP every turn.\nOtherwise: Lowers the user''s Speed by one stage, and raises its Attack and Defense by one stage each.\n\nThe curse effect is passed on by baton pass.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(175,'flail','physical',15,NULL,0,100,'normal',NULL,'Inflicts more damage when the user has less HP remaining, with a maximum of 200 power.',replace('Inflicts regular damage.  Power varies inversely with the user''s proportional remaining HP.\n\n64 * current HP / max HP | Power\n-----------------------: | ----:\n 0– 1                    |  200\n 2– 5                    |  150\n 6–12                    |  100\n13–21                    |   80\n22–42                    |   40\n43–64                    |   20\n','\n',char(10)),NULL);
INSERT INTO move VALUES(176,'conversion-2','status',30,NULL,0,NULL,'normal',NULL,'Changes the user''s type to a random type either resistant or immune to the last move used against it.','Changes the user''s type to a type either resistant or immune to the last damaging move that hit it.  The new type is selected at random and cannot be a type the user already is.  If there is no eligible new type, this move will fail.',NULL);
INSERT INTO move VALUES(177,'aeroblast','special',5,100,0,95,'flying',NULL,'Has an increased chance for a critical hit.','Inflicts regular damage.  User''s critical hit rate is one level higher when using this move.',NULL);
INSERT INTO move VALUES(178,'cotton-spore','status',40,NULL,0,100,'grass',NULL,'Lowers the target''s Speed by two stages.','Lowers the target''s Speed by two stages.',NULL);
INSERT INTO move VALUES(179,'reversal','physical',15,NULL,0,100,'fighting',NULL,'Inflicts more damage when the user has less HP remaining, with a maximum of 200 power.',replace('Inflicts regular damage.  Power varies inversely with the user''s proportional remaining HP.\n\n64 * current HP / max HP | Power\n-----------------------: | ----:\n 0– 1                    |  200\n 2– 5                    |  150\n 6–12                    |  100\n13–21                    |   80\n22–42                    |   40\n43–64                    |   20\n','\n',char(10)),NULL);
INSERT INTO move VALUES(180,'spite','status',10,NULL,0,100,'ghost',NULL,'Lowers the PP of the target''s last used move by 4.','Lowers the PP of the target''s last used move by 4.  If the target hasn''t used a move since entering the field, if it tried to use a move this turn and failed, or if its last used move has 0 PP remaining, this move will fail.',NULL);
INSERT INTO move VALUES(181,'powder-snow','special',25,40,0,100,'ice',NULL,'Has a $effect_chance% chance to freeze the target.','Inflicts regular damage.  Has a $effect_chance% chance to freeze the target.',10);
INSERT INTO move VALUES(182,'protect','status',10,NULL,4,NULL,'normal',NULL,'Prevents any moves from hitting the user this turn.',replace('No moves will hit the user for the remainder of this turn.  If the user is last to act this turn, this move will fail.\n\nIf the user successfully used detect, endure, protect, quick guard, or wide guard on the last turn, this move has a 50% chance to fail.\n\nlock on, mind reader, and no guard provide a (100 – accuracy)% chance for moves to break through this move.  This does not apply to one-hit KO moves (fissure, guillotine, horn drill, and sheer cold); those are always blocked by this move.\n\nthunder during rain dance and blizzard during hail have a 30% chance to break through this move.\n\nThe following effects are not prevented by this move:\n\n* acupressure from an ally\n* curse''s curse effect\n* Delayed damage from doom desire and future sight; however, these moves will be prevented if they are used this turn\n* feint, which will also end this move''s protection after it hits\n* imprison\n* perish song\n* shadow force\n* Moves that merely copy the user, such as transform or psych up\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(183,'mach-punch','physical',30,40,1,100,'fighting',NULL,'Inflicts regular damage with no additional effect.','Inflicts regular damage.',NULL);
