INSERT INTO move VALUES(190,'octazooka','special',10,65,0,85,'water',NULL,'Has a $effect_chance% chance to lower the target''s accuracy by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s accuracy by one stage.',50);
INSERT INTO move VALUES(191,'spikes','status',20,NULL,0,NULL,'ground',NULL,'Scatters Spikes, hurting opposing Pokémon that switch in.',replace('Scatters spikes around the opposing field, which damage opposing Pokémon that enter the field for 1/8 of their max HP.  Pokémon immune to ground moves are immune to this damage, except during gravity.  Up to three layers of spikes may be laid down, adding 1/16 to the damage done: two layers of spikes damage for 3/16 max HP, and three layers damage for 1/4 max HP.\n\nwonder guard does not block damage from this effect.\n\nrapid spin removes this effect from its user''s side of the field.  defog removes this effect from its target''s side of the field.','\n',char(10)),NULL);
INSERT INTO move VALUES(192,'zap-cannon','special',5,120,0,50,'electric',NULL,'Has a $effect_chance% chance to paralyze the target.','Inflicts regular damage.  Has a $effect_chance% chance to paralyze the target.',100);
INSERT INTO move VALUES(193,'foresight','status',40,NULL,0,NULL,'normal',NULL,'Forces the target to have no Evade, and allows it to be hit by Normal and Fighting moves even if it''s a Ghost.','Resets the target''s evasion to normal and prevents any further boosting until the target leaves the field.  A ghost under this effect takes normal damage from normal and fighting moves.  This move itself ignores accuracy and evasion modifiers.',NULL);
INSERT INTO move VALUES(194,'destiny-bond','status',5,NULL,0,NULL,'ghost',NULL,'If the user faints this turn, the target automatically will, too.',replace('If the user faints before its next move, the Pokémon that fainted it will automatically faint.  End-of-turn damage is ignored.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(195,'perish-song','status',5,NULL,0,NULL,'normal',NULL,'User and target both faint after three turns.',replace('Every Pokémon is given a counter that starts at 3 and decreases by 1 at the end of every turn, including this one.  When a Pokémon''s counter reaches zero, that Pokémon faints.  A Pokémon that leaves the field will lose its counter; its replacement does not inherit the effect, and other Pokémon''s counters remain.\n\nThis effect is passed on by baton pass.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(196,'icy-wind','special',15,55,0,95,'ice',NULL,'Has a $effect_chance% chance to lower the target''s Speed by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Speed by one stage.',100);
INSERT INTO move VALUES(197,'detect','status',5,NULL,4,NULL,'fighting',NULL,'Prevents any moves from hitting the user this turn.',replace('No moves will hit the user for the remainder of this turn.  If the user is last to act this turn, this move will fail.\n\nIf the user successfully used detect, endure, protect, quick guard, or wide guard on the last turn, this move has a 50% chance to fail.\n\nlock on, mind reader, and no guard provide a (100 – accuracy)% chance for moves to break through this move.  This does not apply to one-hit KO moves (fissure, guillotine, horn drill, and sheer cold); those are always blocked by this move.\n\nthunder during rain dance and blizzard during hail have a 30% chance to break through this move.\n\nThe following effects are not prevented by this move:\n\n* acupressure from an ally\n* curse''s curse effect\n* Delayed damage from doom desire and future sight; however, these moves will be prevented if they are used this turn\n* feint, which will also end this move''s protection after it hits\n* imprison\n* perish song\n* shadow force\n* Moves that merely copy the user, such as transform or psych up\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(198,'bone-rush','physical',10,25,0,90,'ground',NULL,'Hits 2-5 times in one turn.',replace('Inflicts regular damage.  Hits 2–5 times in one turn.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.','\n',char(10)),NULL);
INSERT INTO move VALUES(199,'lock-on','status',5,NULL,0,NULL,'normal',NULL,'Ensures that the user''s next move will hit the target.',replace('If the user targets the same target again before the end of the next turn, the move it uses is guaranteed to hit.  This move itself also ignores accuracy and evasion modifiers.\n\nOne-hit KO moves are also guaranteed to hit, as long as the user is equal or higher level than the target.  This effect also allows the user to hit Pokémon that are off the field due to moves such as dig or fly.\n\nIf the target uses detect or protect while under the effect of this move, the user is not guaranteed to hit, but has a (100 - accuracy)% chance to break through the protection.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(200,'outrage','physical',10,120,0,100,'dragon',NULL,'Hits every turn for 2-3 turns, then confuses the user.',replace('Inflicts regular damage.  User is forced to attack with this move for 2–3 turns,selected at random.  After the last hit, the user becomes confused.\n\nsafeguard does not protect against the confusion from this move.','\n',char(10)),NULL);
INSERT INTO move VALUES(201,'sandstorm','status',10,NULL,0,NULL,'rock',NULL,'Changes the weather to a sandstorm for five turns.',replace('Changes the weather to a sandstorm for five turns.  Pokémon that are not ground, rock, or steel take 1/16 their max HP at the end of every turn.  Every rock Pokémon''s original Special Defense is raised by 50% for the duration of this effect.\n\nsolar beam''s power is halved.\n\nmoonlight, morning sun, and synthesis only heal 1/4 the user''s max HP.','\n',char(10)),NULL);
INSERT INTO move VALUES(202,'giga-drain','special',10,75,0,100,'grass',NULL,'Drains half the damage inflicted to heal the user.','Inflicts regular damage.  Drains half the damage inflicted to heal the user.',NULL);
INSERT INTO move VALUES(203,'endure','status',10,NULL,4,NULL,'normal',NULL,'Prevents the user''s HP from lowering below 1 this turn.',replace('The user''s HP cannot be lowered below 1 by any means for the remainder of this turn.\n\nIf the user successfully used detect, endure, protect, quick guard, or wide guard on the last turn, this move has a 50% chance to fail.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(204,'charm','status',20,NULL,0,100,'fairy',NULL,'Lowers the target''s Attack by two stages.','Lowers the target''s Attack by two stages.',NULL);
INSERT INTO move VALUES(205,'rollout','physical',20,30,0,90,'rock',NULL,'Power doubles every turn this move is used in succession after the first, resetting after five turns.',replace('Inflicts regular damage.  User is forced to use this move for five turns.  Power doubles every time this move is used in succession to a maximum of 16x, and resets to normal after the lock-in ends.  If this move misses or becomes unusable, the lock-in ends.\n\nIf the user has used defense curl since entering the field, this move has double power.','\n',char(10)),NULL);
INSERT INTO move VALUES(206,'false-swipe','physical',40,40,0,100,'normal',NULL,'Cannot lower the target''s HP below 1.','Inflicts regular damage.  Will not reduce the target''s HP below 1.',NULL);
INSERT INTO move VALUES(207,'swagger','status',15,NULL,0,85,'normal',NULL,'Raises the target''s Attack by two stages and confuses the target.','Raises the target''s Attack by two stages, then confuses it.  If the target''s Attack cannot be raised by two stages, the confusion is not applied.',NULL);
INSERT INTO move VALUES(208,'milk-drink','status',10,NULL,0,NULL,'normal',NULL,'Heals the user by half its max HP.','Heals the user for half its max HP.',NULL);
INSERT INTO move VALUES(209,'spark','physical',20,65,0,100,'electric',NULL,'Has a $effect_chance% chance to paralyze the target.','Inflicts regular damage.  Has a $effect_chance% chance to paralyze the target.',30);
INSERT INTO move VALUES(210,'fury-cutter','physical',20,40,0,95,'bug',NULL,'Power doubles every turn this move is used in succession after the first, maxing out after five turns.','Inflicts regular damage.  Power doubles after every time this move is used, whether consecutively or not, maxing out at 16x.  If this move misses or the user leaves the field, power resets.',NULL);
INSERT INTO move VALUES(211,'steel-wing','physical',25,70,0,90,'steel',NULL,'Has a $effect_chance% chance to raise the user''s Defense by one stage.','Inflicts regular damage. Has a $effect_chance% chance to raise the user''s Defense one stage.',10);
INSERT INTO move VALUES(212,'mean-look','status',5,NULL,0,NULL,'normal',NULL,'Prevents the target from leaving battle.',replace('The target cannot switch out normally.  Ignores accuracy and evasion modifiers.  This effect ends when the user leaves the field.\n\nThe target may still escape by using baton pass, u turn, or a shed shell.\n\nBoth the user and the target pass on this effect with baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(213,'attract','status',15,NULL,0,100,'normal',NULL,'Target falls in love if it has the opposite gender, and has a 50% chance to refuse attacking the user.','Causes the target to fall in love with the user, giving it a 50% chance to do nothing each turn.  If the user and target are the same gender, or either is genderless, this move will fail.  If either Pokémon leaves the field, this effect ends.',NULL);
INSERT INTO move VALUES(214,'sleep-talk','status',10,NULL,0,NULL,'normal',NULL,'Randomly uses one of the user''s other three moves.  Only works if the user is sleeping.',replace('Only usable if the user is sleeping.  Randomly selects and uses one of the user''s other three moves.  Use of the selected move requires and costs 0 PP.\n\nThis move will not select assist, bide, bounce, chatter, copycat, dig, dive, fly, focus punch, me first, metronome, mirror move, shadow force, skull bash, sky attack, sky drop, sleep talk, solar beam, razor wind, or uproar.\n\nIf the selected move requires a recharge turn—i.e., one of blast burn, frenzy plant, giga impact, hydro cannon, hyper beam, roar of time, or rock wrecker—and the user is still sleeping next turn, then it''s forced to use this move again and pay another PP for the recharge turn.\n\nThis move cannot be copied by mirror move, nor selected by assist, metronome, or sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(215,'heal-bell','status',5,NULL,0,NULL,'normal',NULL,'Cures the entire party of major status effects.','Removes major status effects and confusion from every Pokémon in the user''s party.',NULL);
INSERT INTO move VALUES(216,'return','physical',20,NULL,0,100,'normal',NULL,'Power increases with happiness, up to a maximum of 102.','Inflicts regular damage.  Power increases with happiness, given by `happiness * 2 / 5`, to a maximum of 102.  Power bottoms out at 1.',NULL);
INSERT INTO move VALUES(217,'present','physical',15,NULL,0,90,'normal',NULL,'Randomly inflicts damage with power from 40 to 120 or heals the target for 1/4 its max HP.',replace('Randomly uses one of the following effects.\n\nEffect                                             | Chance\n-------------------------------------------------- | -----:\nInflicts regular damage with 40 power  |    40%\nInflicts regular damage with 80 power  |    30%\nInflicts regular damage with 120 power |    10%\nHeals the target for 1/4 its max HP    |    20%\n\nOn average, this move inflicts regular damage with 52 power and heals the target for 1/20 its max HP.','\n',char(10)),NULL);
INSERT INTO move VALUES(218,'frustration','physical',20,NULL,0,100,'normal',NULL,'Power increases as happiness decreases, up to a maximum of 102.','Inflicts regular damage.  Power increases inversely with happiness, given by `(255 - happiness) * 2 / 5`, to a maximum of 102.  Power bottoms out at 1.',NULL);
INSERT INTO move VALUES(219,'safeguard','status',25,NULL,0,NULL,'normal',NULL,'Protects the user''s field from major status ailments and confusion for five turns.',replace('Protects Pokémon on the user''s side of the field from major status effects and confusion for five turns.  Does not cancel existing ailments.  This effect remains even if the user leaves the field.\n\nIf yawn is used while this move is in effect, it will immediately fail.\n\ndefog used by an opponent will end this effect.\n\nThis effect does not prevent the confusion caused by outrage, petal dance, or thrash.','\n',char(10)),NULL);
INSERT INTO move VALUES(220,'pain-split','status',20,NULL,0,NULL,'normal',NULL,'Sets the user''s and targets''s HP to the average of their current HP.',replace('Changes the user''s and target''s remaining HP to the average of their current remaining HP.  Ignores accuracy and evasion modifiers.  This effect does not count as inflicting damage for other moves and effects that respond to damage taken.\n\nThis effect fails against a substitute.','\n',char(10)),NULL);
INSERT INTO move VALUES(221,'sacred-fire','physical',5,100,0,95,'fire',NULL,'Has a $effect_chance% chance to burn the target.  Lets frozen Pokémon thaw themselves.','Inflicts regular damage.  Has a $effect_chance% chance to burn the target.  Frozen Pokémon may use this move, in which case they will thaw.',50);
INSERT INTO move VALUES(222,'magnitude','physical',30,NULL,0,100,'ground',NULL,'Power varies randomly from 10 to 150.',replace('Inflicts regular damage.  Power is selected at random between 10 and 150, with an average of 71:\n\nMagnitude | Power | Chance\n--------: | ----: | -----:\n        4 |    10 |     5%\n        5 |    30 |    10%\n        6 |    50 |    20%\n        7 |    70 |    30%\n        8 |    90 |    20%\n        9 |   110 |    10%\n       10 |   150 |     5%\n\nThis move has double power against Pokémon currently underground due to dig.','\n',char(10)),NULL);
INSERT INTO move VALUES(223,'dynamic-punch','physical',5,100,0,50,'fighting',NULL,'Has a $effect_chance% chance to confuse the target.','Inflicts regular damage.  Has a $effect_chance% chance to confuse the target.',100);
INSERT INTO move VALUES(224,'megahorn','physical',10,120,0,85,'bug',NULL,'Inflicts regular damage with no additional effect.','Inflicts regular damage.',NULL);
INSERT INTO move VALUES(225,'dragon-breath','special',20,60,0,100,'dragon',NULL,'Has a $effect_chance% chance to paralyze the target.','Inflicts regular damage.  Has a $effect_chance% chance to paralyze the target.',30);
INSERT INTO move VALUES(226,'baton-pass','status',40,NULL,0,NULL,'normal',NULL,'Allows the trainer to switch out the user and pass effects along to its replacement.',replace('User switches out, and the trainer selects a replacement Pokémon from the party.  Stat changes, confusion, and persistent move effects are passed along to the replacement Pokémon.\n\nThe following move effects are passed:\n\n* aqua ring\n* both the user''s and target''s effect of block, mean look, and spider web\n* the curse effect of curse\n* embargo\n* focus energy or an activated lansat berry\n* gastro acid\n* ingrain\n* being sapped by leech seed\n* being targeted by lock on or mind reader\n* magnet rise\n* perish song''s counter\n* power trick\n* substitute; the doll''s HP is unchanged\n\nThe replacement Pokémon does not trigger effects that respond to Pokémon switching in.','\n',char(10)),NULL);
INSERT INTO move VALUES(227,'encore','status',5,NULL,0,100,'normal',NULL,'Forces the target to repeat its last used move every turn for 2 to 6 turns.',replace('The next 4–8 times (selected at random) the target attempts to move, it is forced to repeat its last used move.  If the selected move allows the trainer to select a target, an opponent will be selected at random each turn.  If the target is prevented from using the selected move by some other effect, struggle will be used instead.  This effect ends if the selected move runs out of PP.\n\nIf the target hasn''t used a move since entering the field, if it tried to use a move this turn and failed, if it does not know the selected move, or if the selected move has 0 PP remaining, this move will fail.  If the target''s last used move was encore, mimic, mirror move, sketch, struggle, or transform, this move will fail.','\n',char(10)),NULL);
INSERT INTO move VALUES(228,'pursuit','physical',20,40,0,100,'dark',NULL,'Has double power against, and can hit, Pokémon attempting to switch out.',replace('Inflicts regular damage.  If the target attempts to switch out this turn before the user acts, this move hits the target before it leaves and has double power.\n\nThis effect can still hit a Pokémon that switches out when it has a substitute up or when an ally has used follow me.','\n',char(10)),NULL);
INSERT INTO move VALUES(229,'rapid-spin','physical',40,50,0,100,'normal',NULL,'Frees the user from binding moves, removes Leech Seed, and blows away Spikes.','Inflicts regular damage.  Removes leech seed from the user, frees the user from bind, clamp, fire spin, magma storm, sand tomb, whirlpool, and wrap, and clears spikes, stealth rock, and toxic spikes from the user''s side of the field.  If this move misses or has no effect, its effect doesn''t activate.',100);
INSERT INTO move VALUES(230,'sweet-scent','status',20,NULL,0,100,'normal',NULL,'Lowers the target''s evasion by one stage.','Lowers the target''s evasion by one stage.',NULL);
INSERT INTO move VALUES(231,'iron-tail','physical',15,100,0,75,'steel',NULL,'Has a $effect_chance% chance to lower the target''s Defense by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Defense by one stage.',30);
INSERT INTO move VALUES(232,'metal-claw','physical',35,50,0,95,'steel',NULL,'Has a $effect_chance% chance to raise the user''s Attack by one stage.','Inflicts regular damage. Has a $effect_chance% chance to raise the user''s Attack one stage.',10);
INSERT INTO move VALUES(233,'vital-throw','physical',10,70,-1,NULL,'fighting',NULL,'Never misses.','Inflicts regular damage.  Ignores accuracy and evasion modifiers.',NULL);
INSERT INTO move VALUES(234,'morning-sun','status',5,NULL,0,NULL,'normal',NULL,'Heals the user by half its max HP.  Affected by weather.',replace('Heals the user for half its max HP.\n\nDuring sunny day, the healing is increased to 2/3 max HP.\n\nDuring hail, rain dance, or sandstorm, the healing is decreased to 1/4 max HP.','\n',char(10)),NULL);
INSERT INTO move VALUES(235,'synthesis','status',5,NULL,0,NULL,'grass',NULL,'Heals the user by half its max HP.  Affected by weather.',replace('Heals the user for half its max HP.\n\nDuring sunny day, the healing is increased to 2/3 max HP.\n\nDuring hail, rain dance, or sandstorm, the healing is decreased to 1/4 max HP.','\n',char(10)),NULL);
INSERT INTO move VALUES(236,'moonlight','status',5,NULL,0,NULL,'fairy',NULL,'Heals the user by half its max HP.  Affected by weather.',replace('Heals the user for half its max HP.\n\nDuring sunny day, the healing is increased to 2/3 max HP.\n\nDuring hail, rain dance, or sandstorm, the healing is decreased to 1/4 max HP.','\n',char(10)),NULL);
INSERT INTO move VALUES(237,'hidden-power','special',15,60,0,100,'normal',NULL,'Power and type depend upon user''s IVs.  Power can range from 30 to 70.',replace('Inflicts regular damage.  Power and type are determined by the user''s IVs.\n\nPower is given by `x * 40 / 63 + 30`.  `x` is obtained by arranging bit 1 from the IV for each of Special Defense, Special Attack, Speed, Defense, Attack, and HP in that order.  (Bit 1 is 1 if the IV is of the form `4n + 2` or `4n + 3`.  `x` is then 64 * Special Defense IV bit 1, plus 32 * Special Attack IV bit 1, etc.)\n\nPower is always between 30 and 70, inclusive.  Average power is 49.5.\n\nType is given by `y * 15 / 63`, where `y` is similar to `x` above, except constructed from bit 0.  (Bit 0 is 1 if the IV is odd.)  The result is looked up in the following table.\n\nValue | Type\n----: | --------\n    0 | fighting\n    1 | flying\n    2 | poison\n    3 | ground\n    4 | rock\n    5 | bug\n    6 | ghost\n    7 | steel\n    8 | fire\n    9 | water\n   10 | grass\n   11 | electric\n   12 | psychic\n   13 | ice\n   14 | dragon\n   15 | dark\n\nThis move thus cannot be normal.  Most other types have an equal 1/16 chance to be selected, given random IVs.  However, due to the flooring used here, bug, fighting, and grass appear 5/64 of the time, and dark only 1/64 of the time.','\n',char(10)),NULL);
INSERT INTO move VALUES(238,'cross-chop','physical',5,100,0,80,'fighting',NULL,'Has an increased chance for a critical hit.','Inflicts regular damage.  User''s critical hit rate is one level higher when using this move.',NULL);
INSERT INTO move VALUES(239,'twister','special',20,40,0,100,'dragon',NULL,'Has a $effect_chance% chance to make the target flinch.',replace('Inflicts regular damage.  Has a $effect_chance% chance to make each target flinch.\n\nIf the target is under the effect of bounce, fly, or sky drop, this move will hit with double power.','\n',char(10)),20);
INSERT INTO move VALUES(240,'rain-dance','status',5,NULL,0,NULL,'water',NULL,'Changes the weather to rain for five turns.',replace('Changes the weather to rain for five turns, during which water moves inflict 50% extra damage, and fire moves inflict half damage.\n\nIf the user is holding damp rock, this effect lasts for eight turns.\n\nthunder has 100% accuracy.  If the target has used detect or protect, thunder has a (100 - accuracy)% chance to break through the protection.\n\nsolar beam has half power.\n\nmoonlight, morning sun, and synthesis heal only 1/4 of the user''s max HP.\n\nPokémon with swift swim have doubled original Speed.\n\nPokémon with forecast become water.\n\nPokémon with dry skin heal 1/8 max HP, Pokémon with hydration are cured of major status effects, and Pokémon with rain dish heal 1/16 max HP at the end of each turn.','\n',char(10)),NULL);
INSERT INTO move VALUES(241,'sunny-day','status',5,NULL,0,NULL,'fire',NULL,'Changes the weather to sunny for five turns.',replace('Changes the weather to sunshine for five turns, during which fire moves inflict 50% extra damage, and water moves inflict half damage.\n\nIf the user is holding heat rock, this effect lasts for eight turns.\n\nPokémon cannot become frozen.\n\nthunder has 50% accuracy.\n\nsolar beam skips its charge turn.\n\nmoonlight, morning sun, and synthesis heal 2/3 of the user''s max HP.\n\nPokémon with chlorophyll have doubled original Speed.\n\nPokémon with forecast become fire.\n\nPokémon with leaf guard are not affected by major status effects.\n\nPokémon with flower gift change form; every Pokémon on their side of the field have their original Attack and Special Attack increased by 50%.\n\nPokémon with dry skin lose 1/8 max HP at the end of each turn.\n\nPokémon with solar power have their original Special Attack raised by 50% but lose 1/8 their max HP at the end of each turn.','\n',char(10)),NULL);
INSERT INTO move VALUES(242,'crunch','physical',15,80,0,100,'dark',NULL,'Has a $effect_chance% chance to lower the target''s Defense by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Defense by one stage.',20);
INSERT INTO move VALUES(243,'mirror-coat','special',20,NULL,-5,100,'psychic',NULL,'Inflicts twice the damage the user received from the last special hit it took.',replace('Targets the last opposing Pokémon to hit the user with a special move this turn.  Inflicts twice the damage that move did to the user.  If there is no eligible target, this move will fail.  Type immunity applies, but other type effects are ignored.\n\nThis move cannot be copied by mirror move, nor selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(244,'psych-up','status',10,NULL,0,NULL,'normal',NULL,'Discards the user''s stat changes and copies the target''s.',replace('Discards the user''s stat changes and copies the target''s.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(245,'extreme-speed','physical',5,80,2,100,'normal',NULL,'Inflicts regular damage with no additional effect.','Inflicts regular damage.',NULL);
INSERT INTO move VALUES(246,'ancient-power','special',5,60,0,100,'rock',NULL,'Has a $effect_chance% chance to raise all of the user''s stats by one stage.','Inflicts regular damage. Has a $effect_chance% chance to raise all of the user''s stats one stage.',10);
INSERT INTO move VALUES(247,'shadow-ball','special',15,80,0,100,'ghost',NULL,'Has a $effect_chance% chance to lower the target''s Special Defense by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Special Defense by one stage.',20);
INSERT INTO move VALUES(248,'future-sight','special',10,120,0,100,'psychic',NULL,'Hits the target two turns later.',replace('Inflicts typeless regular damage at the end of the third turn, starting with this one.  This move cannot score a critical hit.  If the target switches out, its replacement will be hit instead.  Damage is calculated at the time this move is used; stat changes and switching out during the delay won''t change the damage inflicted.  No move with this effect can be used against the same target again until after the end of the third turn.\n\nThis effect breaks through wonder guard.\n\nIf the target is protected by protect or detect on the turn this move is used, this move will fail.  However, the damage on the third turn will break through protection.\n\nThe damage is applied at the end of the turn, so it ignores endure and focus sash.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(249,'rock-smash','physical',15,40,0,100,'fighting',NULL,'Has a $effect_chance% chance to lower the target''s Defense by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Defense by one stage.',50);
INSERT INTO move VALUES(250,'whirlpool','special',15,35,0,85,'water',NULL,'Prevents the target from leaving battle and inflicts 1/16 its max HP in damage for 2-5 turns.',replace('Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.\n\nIf the target is in the first turn of dive, this move will hit with double power.','\n',char(10)),100);
INSERT INTO move VALUES(251,'beat-up','physical',10,NULL,0,100,'dark',NULL,'Hits once for every conscious Pokémon the trainer has.',replace('Inflicts typeless regular damage.  Every Pokémon in the user''s party, excepting those that have fainted or have a major status effect, attacks the target.  Calculated stats are ignored; the base stats for the target and assorted attackers are used instead.  The random factor in the damage formula is not used.  dark Pokémon still get STAB.\n\nThis effect breaks through wonder guard.','\n',char(10)),NULL);
INSERT INTO move VALUES(252,'fake-out','physical',10,40,3,100,'normal',NULL,'Can only be used as the first move after the user enters battle.  Causes the target to flinch.','Inflicts regular damage.  Causes the target to flinch.  Can only be used on the user''s first turn after entering the field.',100);
INSERT INTO move VALUES(253,'uproar','special',10,90,0,100,'normal',NULL,'Forced to use this move for several turns.  Pokémon cannot fall asleep in that time.',replace('Inflicts regular damage.  User is forced to use this move for 2–5 turns, selected at random.  All Pokémon on the field wake up, and none can fall to sleep until the lock-in ends.\n\nPokémon cannot use rest during this effect.\n\nThis move cannot be selected by sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(254,'stockpile','status',20,NULL,0,NULL,'normal',NULL,'Stores energy up to three times for use with Spit Up and Swallow.',replace('Raises the user''s Defense and Special Defense by one stage each.  Stores energy for use with spit up and swallow.  Up to three levels of energy can be stored, and all are lost if the user leaves the field.  Energy is still stored even if the stat boosts cannot be applied.\n\nIf the user uses baton pass, the stat boosts are passed as normal, but the stored energy is not.','\n',char(10)),NULL);
INSERT INTO move VALUES(255,'spit-up','special',10,NULL,0,100,'normal',NULL,'Power is 100 times the amount of energy Stockpiled.',replace('Inflicts regular damage.  Power is equal to 100 times the amount of energy stored by stockpile.  Ignores the random factor in the damage formula.  Stored energy is consumed, and the user''s Defense and Special Defense are reset to what they would be if stockpile had not been used.  If the user has no energy stored, this move will fail.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(256,'swallow','status',10,NULL,0,NULL,'normal',NULL,'Recovers 1/4 HP after one Stockpile, 1/2 HP after two Stockpiles, or full HP after three Stockpiles.','Heals the user depending on the amount of energy stored by stockpile: 1/4 its max HP after one use, 1/2 its max HP after two uses, or fully after three uses.  Stored energy is consumed, and the user''s Defense and Special Defense are reset to what they would be if stockpile had not been used.  If the user has no energy stored, this move will fail.',NULL);
INSERT INTO move VALUES(257,'heat-wave','special',10,95,0,90,'fire',NULL,'Has a $effect_chance% chance to burn the target.','Inflicts regular damage.  Has a $effect_chance% chance to burn the target.',10);
INSERT INTO move VALUES(258,'hail','status',10,NULL,0,NULL,'ice',NULL,'Changes the weather to a hailstorm for five turns.',replace('Changes the weather to hail for five turns, during which non-ice Pokémon are damaged for 1/16 their max HP at the end of every turn.\n\nIf the user is holding icy rock, this effect lasts for eight turns.\n\nblizzard has 100% accuracy.  If the target has used detect or protect, blizzard has a (100 - accuracy)% chance to break through the protection.\n\nmoonlight, morning sun, and synthesis heal only 1/4 of the user''s max HP.\n\nPokémon with snow cloak are exempt from this effect''s damage.','\n',char(10)),NULL);
INSERT INTO move VALUES(259,'torment','status',15,NULL,0,100,'dark',NULL,'Prevents the target from using the same move twice in a row.',replace('Prevents the target from attempting to use the same move twice in a row.  When the target leaves the field, this effect ends.\n\nIf the target is forced to attempt a repeated move due to choice band, choice scarf, choice specs, disable, encore, taunt, only having PP remaining for one move, or any other effect, the target will use struggle instead.  The target is then free to use the forced move next turn, as it didn''t use that move this turn.','\n',char(10)),NULL);
INSERT INTO move VALUES(260,'flatter','status',15,NULL,0,100,'dark',NULL,'Raises the target''s Special Attack by one stage and confuses the target.','Raises the target''s Special Attack by one stage, then confuses it.',NULL);
INSERT INTO move VALUES(261,'will-o-wisp','status',15,NULL,0,85,'fire',NULL,'Burns the target.','Burns the target.',NULL);
INSERT INTO move VALUES(262,'memento','status',10,NULL,0,100,'dark',NULL,'Lowers the target''s Attack and Special Attack by two stages.  User faints.','Lowers the target''s Attack and Special Attack by two stages.  User faints.',NULL);
INSERT INTO move VALUES(263,'facade','physical',20,70,0,100,'normal',NULL,'Power doubles if user is burned, paralyzed, or poisoned.','Inflicts regular damage.  If the user is burned, paralyzed, or poisoned, this move has double power.',NULL);
INSERT INTO move VALUES(264,'focus-punch','physical',20,150,-3,100,'fighting',NULL,'If the user takes damage before attacking, the attack is canceled.',replace('Inflicts regular damage.  If the user takes damage this turn before hitting, this move will fail.\n\nThis move cannot be copied by mirror move, nor selected by assist, metronome, or sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(265,'smelling-salts','physical',10,70,0,100,'normal',NULL,'If the target is paralyzed, inflicts double damage and cures the paralysis.','Inflicts regular damage.  If the target is paralyzed, this move has double power, and the target is cured of its paralysis.',NULL);
INSERT INTO move VALUES(266,'follow-me','status',20,NULL,2,NULL,'normal',NULL,'Redirects the target''s single-target effects to the user for this turn.',replace('Until the end of this turn, any moves that opposing Pokémon target solely at the user''s ally will instead target the user.  If both Pokémon on the same side of the field use this move on the same turn, the Pokémon that uses it last will become the target.\n\nThis effect takes priority over lightning rod and storm drain.\n\nIf the user''s ally switches out, opposing Pokémon may still hit it with pursuit.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(267,'nature-power','status',20,NULL,0,NULL,'normal',NULL,'Uses a move which depends upon the terrain.',replace('Uses another move chosen according to the terrain.\n\nTerrain                   | Selected move\n------------------------- | ------------------\nBuilding                  | tri attack\nCave                      | rock slide\nDeep water                | hydro pump\nDesert                    | earthquake\nGrass                     | seed bomb\nMountain                  | rock slide\nRoad                      | earthquake\nShallow water             | hydro pump\nSnow                      | blizzard\nTall grass                | seed bomb\nelectric terrain | thunderbolt\ngrassy terrain   | energy ball\nmisty terrain    | moonblast\n\nIn Pokémon Battle Revolution:\n\nTerrain        | Selected move\n-------------- | ------------------\nCourtyard      | tri attack\nCrystal        | rock slide\nGateway        | hydro pump\nMagma          | rock slide\nMain Street    | tri attack\nNeon           | tri attack\nStargazer      | rock slide\nSunny Park     | seed bomb\nSunset         | earthquake\nWaterfall      | seed bomb\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(268,'charge','status',20,NULL,0,NULL,'electric',NULL,'Raises the user''s Special Defense by one stage.  User''s Electric moves have doubled power next turn.','Raises the user''s Special Defense by one stage.  If the user uses an electric move next turn, its power will be doubled.',NULL);
INSERT INTO move VALUES(269,'taunt','status',20,NULL,0,100,'dark',NULL,'For the next few turns, the target can only use damaging moves.',replace('Target is forced to only use damaging moves for the next 3–5 turns, selected at random.  Moves that select other moves not known in advance do not count as damaging.\n\nassist, copycat, me first, metronome, mirror move, and sleep talk do not directly inflict damage and thus may not be used.\n\nbide, counter, endeavor, metal burst, and mirror coat are allowed.','\n',char(10)),NULL);
INSERT INTO move VALUES(270,'helping-hand','status',20,NULL,5,NULL,'normal',NULL,'Ally''s next move inflicts half more damage.',replace('Boosts the power of the target''s moves by 50% until the end of this turn.\n\nThis move cannot be copied by mirror move, nor selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(271,'trick','status',10,NULL,0,100,'psychic',NULL,'User and target swap items.',replace('User and target permanently swap held items.  Works even if one of the Pokémon isn''t holding anything.  If either Pokémon is holding mail, this move will fail.\n\nIf either Pokémon has multitype or sticky hold, this move will fail.\n\nIf this move results in a Pokémon obtaining choice band, choice scarf, or choice specs, and that Pokémon was the latter of the pair to move this turn, then the move it used this turn becomes its chosen forced move.  This applies even if both Pokémon had a choice item before this move was used.  If the first of the two Pokémon gains a choice item, it may select whatever choice move it wishes next turn.\n\nNeither the user nor the target can recover its item with recycle.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(272,'role-play','status',10,NULL,0,NULL,'psychic',NULL,'Copies the target''s ability.',replace('User''s ability is replaced with the target''s until the user leaves the field.  Ignores accuracy and evasion modifiers.\n\nIf the target has flower gift, forecast, illusion, imposter, multitype, stance change, trace, wonder guard, or zen mode, this move will fail.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(273,'wish','status',10,NULL,0,NULL,'normal',NULL,'User will recover half its max HP at the end of the next turn.','At the end of the next turn, user will be healed for half its max HP.  If the user is switched out, its replacement will be healed instead for half of the user''s max HP.  If the user faints or is forcefully switched by roar or whirlwind, this effect will not activate.',NULL);
INSERT INTO move VALUES(274,'assist','status',20,NULL,0,NULL,'normal',NULL,'Randomly selects and uses one of the trainer''s other Pokémon''s moves.',replace('Uses a move from another Pokémon in the user''s party, both selected at random.  Moves from fainted Pokémon can be used.  If there are no eligible Pokémon or moves, this move will fail.\n\nThis move will not select assist, chatter, circle throw, copycat, counter, covet, destiny bond, detect, dig, dive, dragon tail, endure, feint, fly focus punch, follow me, helping hand, me first, metronome, mimic, mirror coat, mirror move, phantom force protect, quick guard, roar shadow force, sketch, sleep talk, snatch, struggle, switcheroo, thief, trick, whirlwind, or wide guard.\n\nThis move cannot be copied by mirror move, nor selected by metronome or sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(275,'ingrain','status',20,NULL,0,NULL,'grass',NULL,'Prevents the user from leaving battle.  User regains 1/16 of its max HP every turn.',replace('Prevents the user from switching out.  User regains 1/16 of its max HP at the end of every turn.  If the user was immune to ground attacks, it will now take normal damage from them.\n\nroar and whirlwind will not affect the user.  The user cannot use magnet rise.\n\nThe user may still use u turn to leave the field.\n\nThis effect can be passed with baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(276,'superpower','physical',5,120,0,100,'fighting',NULL,'Lowers the user''s Attack and Defense by one stage after inflicting damage.','Inflicts regular damage, then lowers the user''s Attack and Defense by one stage each.',100);
INSERT INTO move VALUES(277,'magic-coat','status',15,NULL,4,NULL,'psychic',NULL,'Reflects back the first effect move used on the user this turn.',replace('The first non-damaging move targeting the user this turn that inflicts major status effects, stat changes, or trapping effects will be reflected at its user.\n\ndefog, memento, and teeter dance are not reflected.\n\nattract, flatter, gastro acid, leech seed, swagger, worry seed, and yawn are reflected.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(278,'recycle','status',10,NULL,0,NULL,'normal',NULL,'User recovers the item it last used up.',replace('User recovers the last item consumed by the user or a Pokémon in its position on the field.  The item must be used again before it can be recovered by this move again.  If the user is holding an item, this move fails.\n\nItems taken or given away by covet, knock off, switcheroo, thief, or trick may not be recovered.','\n',char(10)),NULL);
INSERT INTO move VALUES(279,'revenge','physical',10,60,-4,100,'fighting',NULL,'Inflicts double damage if the user takes damage before attacking this turn.',replace('Inflicts regular damage.  If the target damaged the user this turn and was the last to do so, this move has double power.\n\npain split does not count as damaging the user.','\n',char(10)),NULL);
INSERT INTO move VALUES(280,'brick-break','physical',15,75,0,100,'fighting',NULL,'Destroys Reflect and Light Screen.','Destroys any light screen or reflect on the target''s side of the field, then inflicts regular damage.',NULL);
INSERT INTO move VALUES(281,'yawn','status',10,NULL,0,NULL,'normal',NULL,'Target sleeps at the end of the next turn.',replace('Puts the target to sleep at the end of the next turn.  Ignores accuracy and evasion modifiers.  If the target leaves the field, this effect is canceled.  If the target has a status effect when this move is used, this move will fail.\n\nIf the target is protected by safeguard when this move is used, this move will fail.\n\ninsomnia and vital spirit prevent the sleep if the target has either at the end of the next turn, but will not cause this move to fail on use.','\n',char(10)),NULL);
INSERT INTO move VALUES(282,'knock-off','physical',20,65,0,100,'dark',NULL,'Target drops its held item.',replace('Inflicts regular damage.  Target loses its held item.\n\nNeither the user nor the target can recover its item with recycle.\n\nIf the target has multitype or sticky hold, it will take damage but not lose its item.','\n',char(10)),NULL);
INSERT INTO move VALUES(283,'endeavor','physical',5,NULL,0,100,'normal',NULL,'Lowers the target''s HP to equal the user''s.','Inflicts exactly enough damage to lower the target''s HP to equal the user''s.  If the target''s HP is not higher than the user''s, this move has no effect.  Type immunity applies, but other type effects are ignored.  This effect counts as damage for moves that respond to damage.',NULL);
INSERT INTO move VALUES(284,'eruption','special',5,150,0,100,'fire',NULL,'Inflicts more damage when the user has more HP remaining, with a maximum of 150 power.','Inflicts regular damage.  Power increases with the user''s remaining HP and is given by `150 * HP / max HP`, to a maximum of 150 when the user has full HP.',NULL);
INSERT INTO move VALUES(285,'skill-swap','status',10,NULL,0,NULL,'psychic',NULL,'User and target swap abilities.',replace('User and target switch abilities.  Ignores accuracy and evasion modifiers.\n\nIf either Pokémon has multitype or wonder guard, this move will fail.','\n',char(10)),NULL);
INSERT INTO move VALUES(286,'imprison','status',10,NULL,0,NULL,'psychic',NULL,'Prevents the target from using any moves that the user also knows.','Prevents any Pokémon on the opposing side of the field from using any move the user knows until the user leaves the field.  This effect is live; if the user obtains new moves while on the field, these moves become restricted.  If no opposing Pokémon knows any of the user''s moves when this move is used, this move will fail.',NULL);
INSERT INTO move VALUES(287,'refresh','status',20,NULL,0,NULL,'normal',NULL,'Cleanses the user of a burn, paralysis, or poison.','Removes a burn, paralysis, or poison from the user.',NULL);
INSERT INTO move VALUES(288,'grudge','status',5,NULL,0,NULL,'ghost',NULL,'If the user faints this turn, the PP of the move that fainted it drops to 0.','If the user faints before it next acts, the move that fainted it will have its PP dropped to 0.  End-of-turn damage does not trigger this effect.',NULL);
INSERT INTO move VALUES(289,'snatch','status',10,NULL,4,NULL,'dark',NULL,'Steals the target''s move, if it''s self-targeted.',replace('The next time a Pokémon uses a beneficial move on itself or itself and its ally this turn, the user of this move will steal the move and use it itself.  Moves which may be stolen by this move are identified by the `snatchable` flag.\n\nIf two Pokémon use this move on the same turn, the faster Pokémon will steal the first beneficial move, and the slower Pokémon will then steal it again—thus, only the slowest Pokémon using this move ultimately gains a stolen move''s effect.\n\nIf the user steals psych up, it will target the Pokémon that used psych up.  If the user was the original target of psych up, and the Pokémon that originally used it''s affected by pressure, it will only lose 1 PP.\n\nThis move cannot be copied by mirror move, nor selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(290,'secret-power','physical',20,70,0,100,'normal',NULL,'Has a $effect_chance% chance to inflict a status effect which depends upon the terrain.',replace('Inflicts regular damage.  Has a $effect_chance% chance to inflict an effect chosen according to the terrain.\n\nTerrain        | Effect\n-------------- | -------------------------------------------------------------\nBuilding       | Paralyzes target\nCave           | Makes target flinch\nDeep water     | Lowers target''s Attack by one stage\nDesert         | Lowers target''s accuracy by one stage\nGrass          | Puts target to sleep\nMountain       | Makes target flinch\nRoad           | Lowers target''s accuracy by one stage\nShallow water  | Lowers target''s Attack by one stage\nSnow           | Freezes target\nTall grass     | Puts target to sleep\n\nIn Pokémon Battle Revolution:\n\nTerrain        | Effect\n-------------- | -------------------------------------------------------------\nCourtyard      | Paralyzes target\nCrystal        | Makes target flinch\nGateway        | Lowers target''s Attack by one stage\nMagma          | Makes target flinch\nMain Street    | Paralyzes target\nNeon           | Paralyzes target\nStargazer      | Makes target flinch\nSunny Park     | Puts target to sleep\nSunset         | Lowers target''s accuracy by one stage\nWaterfall      | Puts target to sleep\n','\n',char(10)),30);
INSERT INTO move VALUES(291,'dive','physical',10,80,0,100,'water',NULL,'User dives underwater, dodging all attacks, and hits next turn.',replace('Inflicts regular damage.  User dives underwater for one turn, becoming immune to attack, and hits on the second turn.\n\nDuring the immune turn, surf, and whirlpool still hit the user normally, and their power is doubled if appropriate.\n\nThe user may be hit during its immune turn if under the effect of lock on, mind reader, or no guard.\n\nThis move cannot be selected by sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(292,'arm-thrust','physical',20,15,0,100,'fighting',NULL,'Hits 2-5 times in one turn.',replace('Inflicts regular damage.  Hits 2–5 times in one turn.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.','\n',char(10)),NULL);
INSERT INTO move VALUES(293,'camouflage','status',20,NULL,0,NULL,'normal',NULL,'User''s type changes to match the terrain.',replace('User''s type changes according to the terrain.\n\nTerrain        | New type\n-------------- | --------------\nBuilding       | normal\nCave           | rock\nDesert         | ground\nGrass          | grass\nMountain       | rock\nOcean          | water\nPond           | water\nRoad           | ground\nSnow           | ice\nTall grass     | grass\n\nIn Pokémon Battle Revolution:\n\nTerrain        | New type\n-------------- | --------------\nCourtyard      | normal\nCrystal        | rock\nGateway        | water\nMagma          | rock\nMain Street    | normal\nNeon           | normal\nStargazer      | rock\nSunny Park     | grass\nSunset         | ground\nWaterfall      | grass\n','\n',char(10)),NULL);
INSERT INTO move VALUES(294,'tail-glow','status',20,NULL,0,NULL,'bug',NULL,'Raises the user''s Special Attack by three stages.','Raises the user''s Special Attack by three stages.',NULL);
INSERT INTO move VALUES(295,'luster-purge','special',5,70,0,100,'psychic',NULL,'Has a $effect_chance% chance to lower the target''s Special Defense by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Special Defense by one stage.',50);
INSERT INTO move VALUES(296,'mist-ball','special',5,70,0,100,'psychic',NULL,'Has a $effect_chance% chance to lower the target''s Special Attack by one stage.','Inflicts regular damage.  Has a $effect_chance% chance to lower the target''s Special Attack by one stage.',50);
INSERT INTO move VALUES(297,'feather-dance','status',15,NULL,0,100,'flying',NULL,'Lowers the target''s Attack by two stages.','Lowers the target''s Attack by two stages.',NULL);
INSERT INTO move VALUES(298,'teeter-dance','status',20,NULL,0,100,'normal',NULL,'Confuses the target.','Confuses all targets.',NULL);
INSERT INTO move VALUES(299,'blaze-kick','physical',10,85,0,90,'fire',NULL,'Has an increased chance for a critical hit and a $effect_chance% chance to burn the target.','Inflicts regular damage.  User''s critical hit rate is one level higher when using this move. Has a $effect_chance% chance to burn the target.',10);
INSERT INTO move VALUES(300,'mud-sport','status',15,NULL,0,NULL,'ground',NULL,'Halves all Electric-type damage.','electric moves inflict half damage, regardless of target.  If the user leaves the field, this effect ends.',NULL);
INSERT INTO move VALUES(301,'ice-ball','physical',20,30,0,90,'ice',NULL,'Power doubles every turn this move is used in succession after the first, resetting after five turns.',replace('Inflicts regular damage.  User is forced to use this move for five turns.  Power doubles every time this move is used in succession to a maximum of 16x, and resets to normal after the lock-in ends.  If this move misses or becomes unusable, the lock-in ends.\n\nIf the user has used defense curl since entering the field, this move has double power.','\n',char(10)),NULL);
INSERT INTO move VALUES(302,'needle-arm','physical',15,60,0,100,'grass',NULL,'Has a $effect_chance% chance to make the target flinch.','Inflicts regular damage.  Has a $effect_chance% chance to make the target flinch.',30);
