INSERT INTO move VALUES(304,'hyper-voice','special',10,90,0,100,'normal',NULL,'Inflicts regular damage with no additional effect.','Inflicts regular damage.',NULL);
INSERT INTO move VALUES(305,'poison-fang','physical',15,50,0,100,'poison',NULL,'Has a $effect_chance% chance to badly poison the target.','Inflicts regular damage.  Has a $effect_chance% chance to badly poison the target.',50);
