INSERT INTO move VALUES(328,'sand-tomb','physical',15,35,0,85,'ground',NULL,'Prevents the target from fleeing and inflicts damage for 2-5 turns.',replace('Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.\n\nrapid spin cancels this effect.','\n',char(10)),100);
INSERT INTO move VALUES(329,'sheer-cold','special',5,NULL,0,30,'ice',NULL,'Causes a one-hit KO.',replace('Inflicts damage equal to the target''s max HP.  Ignores accuracy and evasion modifiers.  This move''s accuracy is 30% plus 1% for each level the user is higher than the target.  If the user is a lower level than the target, this move will fail.\n\nBecause this move inflicts a specific and finite amount of damage, endure still prevents the target from fainting.\n\nThe effects of lock on, mind reader, and no guard still apply, as long as the user is equal or higher level than the target.  However, they will not give this move a chance to break through detect or protect.','\n',char(10)),NULL);
