INSERT INTO move VALUES(331,'bullet-seed','physical',30,25,0,100,'grass',NULL,'Hits 2-5 times in one turn.',replace('Inflicts regular damage.  Hits 2–5 times in one turn.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.','\n',char(10)),NULL);
