INSERT INTO move VALUES(343,'covet','physical',25,60,0,100,'normal',NULL,'Takes the target''s item.',replace('Inflicts regular damage.  If the target is holding an item and the user is not, the user will permanently take the item.  Damage is still inflicted if an item cannot be taken.\n\nPokémon with sticky hold or multitype are immune to the item theft effect.\n\nThe target cannot recover its item with recycle.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
