INSERT INTO move VALUES(353,'doom-desire','special',5,140,0,100,'steel',NULL,'Hits the target two turns later.',replace('Inflicts typeless regular damage at the end of the third turn, starting with this one.  This move cannot score a critical hit.  If the target switches out, its replacement will be hit instead.  Damage is calculated at the time this move is used; stat changes and switching out during the delay won''t change the damage inflicted.  No move with this effect can be used against the same target again until after the end of the third turn.\n\nThis effect breaks through wonder guard.\n\nIf the target is protected by protect or detect on the turn this move is used, this move will fail.  However, the damage on the third turn will break through protection.\n\nThe damage is applied at the end of the turn, so it ignores endure and focus sash.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(354,'psycho-boost','special',5,140,0,90,'psychic',NULL,'Lowers the user''s Special Attack by two stages after inflicting damage.','Inflicts regular damage, then lowers the user''s Special Attack by two stages.',100);
INSERT INTO move VALUES(355,'roost','status',10,NULL,0,NULL,'flying',NULL,'Heals the user by half its max HP.','Heals the user for half its max HP.  If the user is flying, its flying type is ignored until the end of this turn.',NULL);
INSERT INTO move VALUES(356,'gravity','status',5,NULL,0,NULL,'psychic',NULL,'Disables moves and immunities that involve flying or levitating for five turns.',replace('For five turns (including this one), all immunities to ground moves are disabled.  For the duration of this effect, the evasion of every Pokémon on the field is lowered by two stages.  Cancels the effects of bounce, fly, and sky drop.\n\nSpecifically, flying Pokémon and those with levitate or that have used magnet rise are no longer immune to ground attacks, arena trap, spikes, or toxic spikes.\n\nbounce, fly, sky drop, high jump kick, jump kick, and splash cannot be used while this move is in effect.\n\n*Bug*: If this move is used during a double or triple battle while Pokémon are under the effect of sky drop, Sky Drop''s effect is not correctly canceled on its target, and it remains high in the air indefinitely.  As Sky Drop prevents the target from acting, the only way to subsequently remove it from the field is to faint it.','\n',char(10)),NULL);
INSERT INTO move VALUES(357,'miracle-eye','status',40,NULL,0,NULL,'psychic',NULL,'Forces the target to have no evasion, and allows it to be hit by Psychic moves even if it''s Dark.','Resets the target''s evasion to normal and prevents any further boosting until the target leaves the field.  A dark Pokémon under this effect takes normal damage from psychic moves.  This move itself ignores accuracy and evasion modifiers.',NULL);
INSERT INTO move VALUES(358,'wake-up-slap','physical',10,70,0,100,'fighting',NULL,'If the target is asleep, has double power and wakes it up.','Inflicts regular damage.  If the target is sleeping, this move has double power, and the target wakes up.',NULL);
INSERT INTO move VALUES(359,'hammer-arm','physical',10,100,0,90,'fighting',NULL,'Lowers user''s Speed by one stage.','Inflicts regular damage, then lowers the user''s Speed by one stage.',100);
INSERT INTO move VALUES(360,'gyro-ball','physical',5,NULL,0,100,'steel',NULL,'Power raises when the user has lower Speed, up to a maximum of 150.','Inflicts regular damage.  Power increases with the target''s current Speed compared to the user, given by `1 + 25 * target Speed / user Speed`, capped at 150.',NULL);
INSERT INTO move VALUES(361,'healing-wish','status',10,NULL,0,NULL,'psychic',NULL,'User faints.  Its replacement has its HP fully restored and any major status effect removed.','User faints.  Its replacement''s HP is fully restored, and any major status effect is removed.  If the replacement Pokémon is immediately fainted by a switch-in effect, the next replacement is healed by this move instead.',NULL);
INSERT INTO move VALUES(362,'brine','special',10,65,0,100,'water',NULL,'Has double power against Pokémon that have less than half their max HP remaining.','Inflicts regular damage.  If the target has less than half its max HP remaining, this move has double power.',NULL);
INSERT INTO move VALUES(363,'natural-gift','physical',15,NULL,0,100,'normal',NULL,'Power and type depend on the held berry.','Inflicts regular damage.  Power and type are determined by the user''s held berry.  The berry is consumed.  If the user is not holding a berry, this move will fail.',NULL);
INSERT INTO move VALUES(364,'feint','physical',10,30,2,100,'normal',NULL,'Hits through Protect and Detect.',replace('Inflicts regular damage.  Removes the effects of detect or protect from the target before hitting.\n\nThis move cannot be copied by mirror move, nor selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(365,'pluck','physical',20,60,0,100,'flying',NULL,'If target has a berry, inflicts double damage and uses the berry.',replace('Inflicts regular damage.  If the target is holding a berry, this move has double power, and the user takes the berry and uses it immediately.\n\nIf the target is holding a jaboca berry or rowap berry, the berry is still removed, but has no effect.\n\nIf this move is super effective and the target is holding a berry that can reduce this move''s damage, it will do so, and will not be stolen.','\n',char(10)),NULL);
INSERT INTO move VALUES(366,'tailwind','status',15,NULL,0,NULL,'flying',NULL,'For three turns, friendly Pokémon have doubled Speed.','For the next three turns, all Pokémon on the user''s side of the field have their original Speed doubled.  This effect remains if the user leaves the field.',NULL);
INSERT INTO move VALUES(367,'acupressure','status',30,NULL,0,NULL,'normal',NULL,'Raises one of a friendly Pokémon''s stats at random by two stages.',replace('Raises one of the target''s stats by two stages.  The raised stat is chosen at random from any stats that can be raised by two stages.  If no stat is eligible, this move will fail.\n\nIf the target has a substitute, this move will have no effect, even if the user is the target.\n\nThis move cannot be copied by mirror move.','\n',char(10)),NULL);
INSERT INTO move VALUES(368,'metal-burst','physical',10,NULL,0,100,'steel',NULL,'Strikes back at the last Pokémon to hit the user this turn with 1.5× the damage.','Targets the last opposing Pokémon to hit the user with a damaging move this turn.  Inflicts 1.5× the damage that move did to the user.  If there is no eligible target, this move will fail.  Type immunity applies, but other type effects are ignored.',NULL);
INSERT INTO move VALUES(369,'u-turn','physical',20,70,0,100,'bug',NULL,'User must switch out after attacking.',replace('Inflicts regular damage, then the user immediately switches out, and the trainer selects a replacement Pokémon from the party.  If the target faints from this attack, the user''s trainer selects the new Pokémon to send out first.  If the user is the last Pokémon in its party that can battle, it will not switch out.\n\nThe user may be hit by pursuit when it switches out, if it has been targeted and pursuit has not yet been used.\n\nThis move may be used even if the user is under the effect of ingrain.  ingrain''s effect will end.','\n',char(10)),NULL);
INSERT INTO move VALUES(370,'close-combat','physical',5,120,0,100,'fighting',NULL,'Lowers the user''s Defense and Special Defense by one stage after inflicting damage.','Inflicts regular damage, then lowers the user''s Defense and Special Defense by one stage each.',100);
INSERT INTO move VALUES(371,'payback','physical',10,50,0,100,'dark',NULL,'Power is doubled if the target has already moved this turn.','Inflicts regular damage.  If the target uses a move or switches out this turn before this move is used, this move has double power.',NULL);
INSERT INTO move VALUES(372,'assurance','physical',10,60,0,100,'dark',NULL,'Power is doubled if the target has already received damage this turn.','Inflicts regular damage.  If the target takes damage this turn for any reason before this move is used, this move has double power.',NULL);
INSERT INTO move VALUES(373,'embargo','status',15,NULL,0,100,'dark',NULL,'Target cannot use held items.',replace('Target cannot use its held item for five turns.  If the target leaves the field, this effect ends.\n\nIf a Pokémon under this effect uses bug bite or pluck on a Pokémon holding a berry, the berry is destroyed but not used.  If a Pokémon under this effect uses fling, it will fail.\n\nThis effect is passed by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(374,'fling','physical',10,NULL,0,100,'dark',NULL,'Throws held item at the target; power depends on the item.',replace('Inflicts regular damage.  Power and type are determined by the user''s held item.  The item is consumed.  If the user is not holding an item, or its item has no set type and power, this move will fail.\n\nThis move ignores sticky hold.\n\nIf the user is under the effect of embargo, this move will fail.','\n',char(10)),NULL);
INSERT INTO move VALUES(375,'psycho-shift','status',10,NULL,0,100,'psychic',NULL,'Transfers the user''s major status effect to the target.','If the user has a major status effect and the target does not, the user''s status is transferred to the target.',NULL);
INSERT INTO move VALUES(376,'trump-card','special',5,NULL,0,NULL,'normal',NULL,'Power increases when this move has less PP, up to a maximum of 200.',replace('Inflicts regular damage.  Power is determined by the PP remaining for this move, after its PP cost is deducted.  Ignores accuracy and evasion modifiers.\n\nPP remaining | Power\n------------ | ----:\n4 or more    |    40\n3            |    50\n2            |    60\n1            |    80\n0            |   200\n\nIf this move is activated by another move, the activating move''s PP is used to calculate power.','\n',char(10)),NULL);
INSERT INTO move VALUES(377,'heal-block','status',15,NULL,0,100,'psychic',NULL,'Prevents target from restoring its HP for five turns.','For the next five turns, the target may not use any moves that only restore HP, and move effects that heal the target are disabled.  Moves that steal HP may still be used, but will only inflict damage and not heal the target.',NULL);
INSERT INTO move VALUES(378,'wring-out','special',5,NULL,0,100,'normal',NULL,'Power increases against targets with more HP remaining, up to a maximum of 121 power.','Inflicts regular damage.  Power directly relates to the target''s relative remaining HP, given by `1 + 120 * current HP / max HP`, to a maximum of 121.',NULL);
INSERT INTO move VALUES(379,'power-trick','status',10,NULL,0,NULL,'psychic',NULL,'User swaps Attack and Defense.',replace('The user''s original Attack and Defense are swapped.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(380,'gastro-acid','status',10,NULL,0,100,'poison',NULL,'Nullifies target''s ability until it leaves battle.',replace('The target''s ability is disabled as long as it remains on the field.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(381,'lucky-chant','status',30,NULL,0,NULL,'normal',NULL,'Prevents the target from scoring critical hits for five turns.','For five turns, opposing Pokémon cannot score critical hits.',NULL);
INSERT INTO move VALUES(382,'me-first','status',20,NULL,0,NULL,'normal',NULL,'Uses the target''s move against it before it attacks, with power increased by half.',replace('If the target has selected a damaging move this turn, the user will copy that move and use it against the target, with a 50% increase in power.\n\nIf the target moves before the user, this move will fail.\n\nThis move cannot be copied by mirror move, nor selected by assist, metronome, or sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(383,'copycat','status',20,NULL,0,NULL,'normal',NULL,'Uses the target''s last used move.',replace('Uses the last move that was used successfully by any Pokémon, including the user.\n\nThis move cannot copy itself, nor roar nor whirlwind.\n\nThis move cannot be copied by mirror move, nor selected by assist, metronome, or sleep talk.','\n',char(10)),NULL);
INSERT INTO move VALUES(384,'power-swap','status',10,NULL,0,NULL,'psychic',NULL,'User swaps Attack and Special Attack changes with the target.','User swaps its Attack and Special Attack stat modifiers modifiers with the target.',NULL);
INSERT INTO move VALUES(385,'guard-swap','status',10,NULL,0,NULL,'psychic',NULL,'User swaps Defense and Special Defense changes with the target.','User swaps its Defense and Special Defense modifiers with the target.',NULL);
INSERT INTO move VALUES(386,'punishment','physical',5,NULL,0,100,'dark',NULL,'Power increases against targets with more raised stats, up to a maximum of 200.','Inflicts regular damage.  Power starts at 60 and is increased by 20 for every stage any of the target''s stats has been raised, capping at 200.  Accuracy and evasion modifiers do not increase this move''s power.',NULL);
INSERT INTO move VALUES(387,'last-resort','physical',5,140,0,100,'normal',NULL,'Can only be used after all of the user''s other moves have been used.','Inflicts regular damage.  This move can only be used if each of the user''s other moves has been used at least once since the user entered the field.  If this is the user''s only move, this move will fail.',NULL);
INSERT INTO move VALUES(388,'worry-seed','status',10,NULL,0,100,'grass',NULL,'Changes the target''s ability to Insomnia.',replace('Changes the target''s ability to insomnia.\n\nIf the target''s ability is truant or multitype, this move will fail.','\n',char(10)),NULL);
INSERT INTO move VALUES(389,'sucker-punch','physical',5,70,1,100,'dark',NULL,'Only works if the target is about to use a damaging move.',replace('Inflicts regular damage.  If the target has not selected a damaging move this turn, or if the target has already acted this turn, this move will fail.\n\nThis move is not affected by iron fist.','\n',char(10)),NULL);
INSERT INTO move VALUES(390,'toxic-spikes','status',20,NULL,0,NULL,'poison',NULL,'Scatters poisoned spikes, poisoning opposing Pokémon that switch in.',replace('Scatters poisoned spikes around the opposing field, which poison opposing Pokémon that enter the field.  A second layer of these spikes may be laid down, in which case Pokémon will be badly poisoned instead.  Pokémon immune to either ground moves or being poisoned are immune to this effect.  Pokémon otherwise immune to ground moves are affected during gravity.\n\nIf a poison Pokémon not immune to ground moves enters a field covered with poisoned spikes, the spikes are removed.\n\nrapid spin will remove this effect from its user''s side of the field.  defog will remove this effect from its target''s side of the field.\n\nThis move does not trigger synchronize, unless the Pokémon with synchronize was forced to enter the field by another effect such as roar.\n\nPokémon entering the field due to baton pass are not affected by this effect.','\n',char(10)),NULL);
INSERT INTO move VALUES(391,'heart-swap','status',10,NULL,0,NULL,'psychic',NULL,'User and target swap stat changes.','User swaps its stat modifiers with the target.',NULL);
INSERT INTO move VALUES(392,'aqua-ring','status',20,NULL,0,NULL,'water',NULL,'Restores 1/16 of the user''s max HP each turn.',replace('Restores 1/16 of the user''s max HP at the end of each turn.  If the user leaves the field, this effect ends.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
INSERT INTO move VALUES(393,'magnet-rise','status',10,NULL,0,NULL,'electric',NULL,'User is immune to Ground moves and effects for five turns.',replace('For five turns, the user is immune to ground moves.\n\nIf the user is under the effect of ingrain or has levitate, this move will fail.\n\nThis effect is temporarily disabled by and cannot be used during gravity.\n\nThis effect is passed on by baton pass.','\n',char(10)),NULL);
