INSERT INTO move VALUES(446,'stealth-rock','status',20,NULL,0,NULL,'rock',NULL,'Causes damage when opposing Pokémon switch in.',replace('Spreads sharp rocks around the opposing field, damaging any Pokémon that enters the field for 1/8 its max HP.  This damage is affected by the entering Pokémon''s susceptibility to rock moves.\n\nrapid spin removes this effect from its user''s side of the field.','\n',char(10)),NULL);
INSERT INTO move VALUES(447,'grass-knot','special',20,NULL,0,100,'grass',NULL,'Inflicts more damage to heavier targets, with a maximum of 120 power.',replace('Inflicts regular damage.  Power increases with the target''s weight in kilograms, to a maximum of 120.\n\nTarget''s weight | Power\n--------------- | ----:\nUp to 10kg      |    20\nUp to 25kg      |    40\nUp to 50kg      |    60\nUp to 100kg     |    80\nUp to 200kg     |   100\nAbove 200kg     |   120\n','\n',char(10)),NULL);
