INSERT INTO move VALUES(449,'judgment','special',10,100,0,100,'normal',NULL,'If the user is holding a appropriate plate or drive, the damage inflicted will match it.',replace('Inflicts regular damage.  If the user is holding a plate or a drive, this move''s type is the type corresponding to that item.\n\nNote: This effect is technically shared by both techno blast and judgment; however, Techno Blast is only affected by drives, and Judgment is only affected by plates.','\n',char(10)),NULL);
INSERT INTO move VALUES(450,'bug-bite','physical',20,60,0,100,'bug',NULL,'If target has a berry, inflicts double damage and uses the berry.',replace('Inflicts regular damage.  If the target is holding a berry, this move has double power, and the user takes the berry and uses it immediately.\n\nIf the target is holding a jaboca berry or rowap berry, the berry is still removed, but has no effect.\n\nIf this move is super effective and the target is holding a berry that can reduce this move''s damage, it will do so, and will not be stolen.','\n',char(10)),NULL);
