INSERT INTO move VALUES(463,'magma-storm','special',5,100,0,75,'fire',NULL,'Prevents the target from fleeing and inflicts damage for 2-5 turns.',replace('Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.\n\nHas a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.\n\nrapid spin cancels this effect.','\n',char(10)),100);
