INSERT INTO move VALUES(476,'rage-powder','status',20,NULL,2,NULL,'bug',NULL,'Redirects the target''s single-target effects to the user for this turn.',replace('Until the end of this turn, any moves that opposing Pokémon target solely at the user''s ally will instead target the user.  If both Pokémon on the same side of the field use this move on the same turn, the Pokémon that uses it last will become the target.\n\nThis effect takes priority over lightning rod and storm drain.\n\nIf the user''s ally switches out, opposing Pokémon may still hit it with pursuit.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(477,'telekinesis','status',15,NULL,0,NULL,'psychic',NULL,'Moves have 100% accuracy against the target for three turns.',replace('For three turns (including this one), moves used against the target have 100% accuracy, but the target is immune to ground damage.  Accuracy of one-hit KO moves is exempt from this effect.\n\nThis effect is removed by gravity.  If Gravity is already in effect, this move will fail.','\n',char(10)),NULL);
