INSERT INTO move VALUES(479,'smack-down','physical',15,50,0,100,'rock',NULL,'Removes any immunity to Ground damage.',replace('Inflicts regular damage.  Removes the target''s immunity to ground-type damage.  This effect removes any existing Ground immunity due to levitate, magnet rise, or telekinesis, and causes the target''s flying type to be ignored when it takes Ground damage.\n\nIf the target isn''t immune to Ground damage, this move will fail.\n\nThis move can hit Pokémon under the effect of bounce, fly, or sky drop, and ends the effect of Bounce or Fly.','\n',char(10)),100);
