INSERT INTO move VALUES(484,'heavy-slam','physical',10,NULL,0,100,'steel',NULL,'Power is higher when the user weighs more than the target, up to a maximum of 120.',replace('Inflicts regular damage.  The greater the user''s weight compared to the target''s, the higher power this move has, to a maximum of 120.\n\nUser''s weight                    | Power\n-------------------------------- | ----:\nUp to 2× the target''s weight     |    40\nUp to 3× the target''s weight     |    60\nUp to 4× the target''s weight     |    80\nUp to 5× the target''s weight     |   100\nMore than 5× the target''s weight |   120\n','\n',char(10)),NULL);
