INSERT INTO move VALUES(497,'echoed-voice','special',15,40,0,100,'normal',NULL,'Power increases by 100% for each consecutive use by any friendly Pokémon, to a maximum of 200.','Inflicts regular damage.  If any friendly Pokémon used this move earlier this turn or on the previous turn, that use''s power is added to this move''s power, to a maximum of 200.',NULL);
