INSERT INTO move VALUES(500,'stored-power','special',10,20,0,100,'psychic',NULL,'Power is higher the more the user''s stats have been raised, to a maximum of 31×.','Inflicts regular damage.  Power is increased by 100% its original value for every stage any of the user''s stats have been raised.  Accuracy, evasion, and lowered stats do not affect this move''s power.  For a Pokémon with all five stats modified to +6, this move''s power is 31×.',NULL);
INSERT INTO move VALUES(501,'quick-guard','status',15,NULL,3,NULL,'fighting',NULL,'Prevents any priority moves from hitting friendly Pokémon this turn.',replace('Moves with priority greater than 0 will not hit friendly Pokémon for the remainder of this turn.  If the user is last to act this turn, this move will fail.\n\nThis move cannot be selected by assist or metronome.','\n',char(10)),NULL);
INSERT INTO move VALUES(502,'ally-switch','status',15,NULL,2,NULL,'psychic',NULL,'User switches places with the friendly Pokémon opposite it.','User switches position on the field with the friendly Pokémon opposite it.  If the user is in the middle position in a triple battle, or there are no other friendly Pokémon, this move will fail.',NULL);
