INSERT INTO move VALUES(509,'circle-throw','physical',10,60,-6,90,'fighting',NULL,'Ends wild battles.  Forces trainers to switch Pokémon.',replace('Inflicts regular damage, then switches the target out for another of its trainer''s Pokémon, selected at random.\n\nIf the target is under the effect of ingrain or suction cups, or it has a substitute, or its Trainer has no more usable Pokémon, it will not be switched out.  If the target is a wild Pokémon, the battle ends instead.','\n',char(10)),NULL);
