INSERT INTO move VALUES(521,'volt-switch','special',20,70,0,100,'electric',NULL,'User must switch out after attacking.',replace('Inflicts regular damage, then the user immediately switches out, and the trainer selects a replacement Pokémon from the party.  If the target faints from this attack, the user''s trainer selects the new Pokémon to send out first.  If the user is the last Pokémon in its party that can battle, it will not switch out.\n\nThe user may be hit by pursuit when it switches out, if it has been targeted and pursuit has not yet been used.\n\nThis move may be used even if the user is under the effect of ingrain.  ingrain''s effect will end.','\n',char(10)),NULL);
