SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS ability;
DROP TABLE IF EXISTS pokemon;
DROP TABLE IF EXISTS move;
DROP TABLE IF EXISTS pokemon_move_association;
SET FOREIGN_KEY_CHECKS=1;

CREATE TABLE ability (
	id INTEGER NOT NULL, 
	ability_name VARCHAR(255), 
	flavour_text_entry VARCHAR(255), 
	short_effect VARCHAR(255), 
	long_effect VARCHAR(3000), 
	PRIMARY KEY (id)
);
CREATE TABLE pokemon (
	id INTEGER NOT NULL, 
	pokemon_name VARCHAR(255) NOT NULL, 
	pokemon_height INTEGER NOT NULL, 
	pokemon_weight INTEGER NOT NULL, 
	type_1 VARCHAR(255) NOT NULL, 
	type_2 VARCHAR(255), 
	ability_id_1 INTEGER, 
	ability_id_2 INTEGER, 
	hp_stat INTEGER NOT NULL, 
	attack_stat INTEGER NOT NULL, 
	defence_stat INTEGER NOT NULL, 
	special_attack_stat INTEGER NOT NULL, 
	special_defence_stat INTEGER NOT NULL, 
	speed_stat INTEGER NOT NULL, sprite varchar(255), 
	PRIMARY KEY (id), 
	UNIQUE (pokemon_name), 
	FOREIGN KEY(ability_id_1) REFERENCES ability (id), 
	FOREIGN KEY(ability_id_2) REFERENCES ability (id)
);
CREATE TABLE move (
	id INTEGER NOT NULL, 
	move_name VARCHAR(255), 
	move_class VARCHAR(255), 
	pp INTEGER, 
	power INTEGER, 
	priority INTEGER, 
	accuracy INTEGER, 
	type VARCHAR(255), 
	flavour_text VARCHAR(255), 
	short_effect VARCHAR(255), 
	long_effect VARCHAR(3000), 
	effect_chance INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE pokemon_move_association (
	id INTEGER NOT NULL, 
	move_id INTEGER, 
	pokemon_id INTEGER, 
	learn_method VARCHAR(255), 
	level_learned INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(move_id) REFERENCES move (id), 
	FOREIGN KEY(pokemon_id) REFERENCES pokemon (id)
);
